(8,	'我國出口相關規定',	'',	'2021-03-19 10:44:48',	1,	1,	NULL,	0,	1,	800,	'https://www.trade.gov.tw/',	'https://www.itri.org.tw/',	'',	'',	'',	'601a10a813d34.png',	'601a11cfc1007.png',	'',	'',	'',	'',	'',	'',	'',	'',	'<h3 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">我國為自由貿易，基本上多數產品只要在國際市場賣得出去，都可以出口，但還是有部分產品被限制。依據我國經濟部國際貿易局統計，在總項數達1萬2,140項產品之中，多達94.6%項目為免證輸出，另5.4%則為限制輸出。</span></span></h3>\n\n<ul>\n	<li>\n	<p style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">有關參考及查詢我國出口管制相關規定資料，可參考經濟部國際貿易局所舉辦的「<a href=\"https://reurl.cc/Y6zkGX\" target=\"_blank\">109年我國貿易管理規定暨國際出口管制趨勢說明會</a>」講義，該說明會PDF檔案，共包含3部分內容。</span></span></p>\n	</li>\n</ul>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、一般貿易管理(第2至45頁)</span></span></h2>\n\n<ol>\n	<li style=\"margin-left: 40px;\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">廠商應利用國際貿易局「<a href=\"https://fbfh.trade.gov.tw/fh/ap/queryCCCRegFormf.do\" target=\"_blank\">貨品分類及輸出入規定</a>」網站，鍵入貨品的H.S.Code，並查詢該項貨品出口是否受到管制。</span></span></li>\n	<li style=\"margin-left: 40px;\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">出口廠商尚須注意「產地標示」及「商標申報」，並按照規定據實辦理。</span></span></li>\n</ol>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">二、高科技貨品輸出入管理(第46至70頁)</span></span></h2>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">我國目前將伊朗、伊拉克、北韓、蘇丹、敘利亞及中國大陸等6國列為出口管制地區。其中北韓已被公告全面禁止貿易，另限制出口12類半導體晶圓製造設備至中國大陸。就產品而言，我國將高端之核能物質與設備、特殊材料與設備、電子、電信及資安等10大類別產品，歸類為「戰略性高科技貨品」(SHTC)。</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">廠商出口產品如屬於前述10大類別產品，需先確認該產品</span></span>\n	<ul>\n		<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">出口貨品是否屬於我國「貨品管理清單」？</span></span></li>\n		<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">交易對象是否屬於我國「實體管理名單」？</span></span></li>\n		<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">交易是否有異常情況(紅色警戒)？</span></span></li>\n		<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">​​​​​如有任一前述情況存在，即應向相關單位申請SHTC輸出許可證。</span></span></li>\n	</ul>\n	</li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">若廠商無法判定出口貨品是否屬於軍商兩用貨品及技術出口管制清單的列管項目，可洽工業技術研究院「<a href=\"https://shtc.org.tw/WebPage/index.aspx\" target=\"_blank\">戰略性高科技貨品鑑定諮詢</a>」，線上申請貨品鑑定。</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">另請參考國際貿易局「經貿資訊網」<a href=\"https://www.trade.gov.tw/Pages/Detail.aspx?nodeID=242&amp;pid=662639\" target=\"_blank\">高科技貨品管理</a>。有相當詳盡的說明，亦有內容豐富的附件可下載。</span></span></li>\n</ol>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">三、我國貿易管理規定暨國際出口管制趨勢說明會(第71至106頁)</span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">進一步介紹軍商兩用管制清單，以及貨品申請鑑定作業。</span></span></p>\n',	'',	'',	'出口規定,自由貿易,貿易管理,線上諮詢',	NULL,	'2021-03-19',	'2021-03-19 02:44:48'),
(9,	'外國進口關稅',	'',	'2021-03-22 10:37:41',	1,	1,	NULL,	0,	1,	700,	'https://www.macmap.org/',	'https://itrade.taiwantrade.com/',	'',	'',	'',	'601a1756f356d.png',	'6020da7f50b6a.jpg',	'',	'',	'',	'',	'iTrade',	'',	'',	'',	'<h3 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">國與國之間的國際貿易，即會牽涉到繳納進口關稅。惟全球貿易實體有百餘國(世界貿易組織WTO即有164個成員)，即使相同產品在不同國家間的貿易，每個國家針對不同來源的進口品，也往往會課徵不同稅率的關稅。現又因以下兩因素，讓關稅更加複雜。</span></span></h3>\n\n<ul style=\"list-style-type:disc\">\n	<li style=\"text-align:justify\">\n	<p><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">自由貿易。如東協10國形成自由貿易區(ASEAN Free Trade Area)。ASEAN另與日、韓、中等國簽訂自由貿易協定，該等國家如與東協國家貿易，亦享有關稅減讓甚至零關稅優惠。</span></span></p>\n	</li>\n	<li style=\"text-align:justify\">\n	<p><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">貿易戰。如美國自川普政府時期，對中國大陸數千項產品加重課徵25%從價稅(Ad-valorem tax)。</span></span></p>\n	</li>\n</ul>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、參閱ITC資料庫：<a href=\"https://www.macmap.org/\" target=\"_blank\">Market Access Map</a></span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">因各國間貿易稅率複雜，且經常更動(如RCEP簽署，或美中兩國後續對貿易戰之調整因應)，可參閱此動態資料庫</span></span></p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\">二、外國關稅查詢實作 (</span></span><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><a href=\"https://www.macmap.org/\" target=\"_blank\">Market Access Map</a>)</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">茲以某廠商在台生產「LED照明產品」(H.S. 94054090)銷往美國市場為例：</span></span></p>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">在最左側的「Exporting Country」，以下拉式選取Taipei, Chinese。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">接著在「Destination Country」，以下拉式選取United States of America </span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">在最右側的「Product HS6」，鍵入940540。等待差不多一或兩秒，會出現一個文字方塊「940540 &mdash; Lamps and lighting fittings&hellip;」，點選該文字方塊。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">按深藍色「SEARCH」。螢幕會再出現「94054040」等4個H.S.8碼的號列。以下拉式方式選取定義最合適的「94054084」(Electric Lamps and Lighting Fittings)。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">電腦螢幕會出現Customs tariffs的相關資訊。其中Applied Tariff欄位顯示為3.9%，代表該產品自台灣銷往美國，進口關稅3.9%。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">依同樣方式，檢索該產品自中國大陸銷往美國，除進口關稅3.9%，另有「貿易救濟」(Trade remedies)一項，顯示自2019年5月10日起，美國針對中國進口產品，另課徵25%從價稅(Ad-valorem tax)。</span></span></li>\n</ol>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><img alt=\"\" src=\"/pic/images/%E9%97%9C%E7%A8%851.jpg\" style=\"height:720px; width:1280px\" /></span></span></p>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><img alt=\"\" src=\"/pic/images/%E9%97%9C%E7%A8%852.jpg\" style=\"height:720px; width:1280px\" /></span></span></p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">三、<a href=\"https://itrade.taitra.org.tw/\" target=\"_blank\">iTrade (全球貿易大數據平台)</a></span></span></h2>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">「iTrade」透過趨勢和圖表分析，協助廠商輕鬆解析複雜的統計數據，即時觀察產品的出口變化，掌握全球市場動態，進一步找出潛力市場。平台也提供貼心的下載服務，一鍵打包分析資料簡便又快速！貿協 iTrade 是您掌握貿易先機的最佳工具。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">提供關稅資訊：綜整各國關稅網站列表提供快速查詢。可有以下兩項查詢功能</span></span></li>\n</ol>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">單一出口國關稅查詢</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">多國關稅比較</span></span></li>\n</ul>\n\n<ol start=\"3\" style=\"margin-left:40px\">\n	<li style=\"text-align: justify;\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">本平台係經濟部國際貿易局主辦，外貿協會執行，惟需加入外貿協會會員才可使用相關服務。</span></span></li>\n</ol>\n',	'',	'',	'外國進口關稅,自由貿易,線上諮詢',	NULL,	'2021-06-07',	'2021-06-07 03:00:24'),
(10,	'外國進口相關規定',	'',	'2021-02-08 09:36:55',	1,	0,	NULL,	0,	1,	600,	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	NULL,	NULL,	NULL,	'',	'',	'',	'',	NULL,	'2021-02-08',	'2021-02-08 01:36:55'),
(11,	'食品類',	'',	'2021-03-19 11:01:50',	10,	1,	NULL,	0,	1,	900,	'https://thpc.taiwantrade.com/',	'https://www.usda.gov/',	'',	'',	'',	'601a1dcfcf4b2.png',	'601a1e849983c.png',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、保健食品</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">目前國內相關產業業者多對拓銷東南亞市場表達濃厚興趣。以下為可參考資料</span></span></p>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">「<a href=\"https://reurl.cc/7oxkkQ\" target=\"_blank\">東協保健品法規技術統一規範之現況</a>」報告</span></span><br />\n	<span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">本報告為「東協保健品協會聯盟」王文秀於2020年9月8日發表，報告厚達87頁，對於東協10國各國的保健品法規，均有詳細介紹。</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">東協主要國家保健食品市場及上市申請相關法規</span></span><br />\n	<span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">此為國際貿易局「經貿諮詢網」於2020年7月28日所發布資訊。共包含菲律賓、越南、泰國、印尼及馬來西亞等5國資訊。</span></span></li>\n</ol>\n\n<p style=\"margin-left:80px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">各國的介紹網頁除有該國法規之概述，另文末有相關附件可直接下載。</span></span></p>\n\n<ul style=\"margin-left:80px\">\n	<li value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">菲律賓保健食品市場及上市申請相關法規：<a href=\"https://reurl.cc/od2zqg\" target=\"_blank\">附件下載網頁</a></span></span></li>\n	<li value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">越南保健食品市場及上市申請相關法規：<a href=\"https://reurl.cc/WLQaV7\" target=\"_blank\">附件下載網頁</a></span></span></li>\n	<li value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">泰國保健食品市場及上市申請相關法規：<a href=\"https://reurl.cc/k0YNQG\" target=\"_blank\">附件下載網頁</a></span></span></li>\n	<li value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">印尼保健食品市場及上市申請相關法規：<a href=\"https://reurl.cc/bR84ad\" target=\"_blank\">附件下載網頁</a></span></span></li>\n	<li value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">馬來西亞保健食品市場及上市申請相關法規：<a href=\"https://reurl.cc/5qWkzG\" target=\"_blank\">附件下載網頁</a></span></span></li>\n</ul>\n\n<ol start=\"3\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">「保健食品產業服務網」研討會講義：<a href=\"https://www.functionalfood.org.tw/sem/lecture.asp\" target=\"_blank\">附件下載網頁</a></span></span></li>\n</ol>\n\n<p style=\"margin-left:80px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">該服務網係「中華穀類食品工業研究所」接受經濟部工業局專案計劃所架設。</span></span><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">主要是提供我國保健食品業者，瞭解國外市場及相關管理法規，以及產品認證與驗證、技術輔導等。</span></span><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">「中華穀類食品工業研究所」亦不定期辦理國外市場相關研討會，部分講義內容甚具參考價值，可直接在此下載。</span></span></p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">二、清真食品認證</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">出口到穆斯林國家，清真認證並非必要條件，此部份視各國規定，在印尼，若台灣廠商想將產品推廣至當地華人市場，而非穆斯林市場，則無須申請清真認證；但若要宣稱清真認可，並進入印尼零售市場，則須取得印尼 LPPOM MUI 清真認證標章，若瞄準印尼 B2B 非零售市場之產品，則可持印尼政府承認的台灣清真認證標章。</span></span></p>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">簡單的說，目標客群若為穆斯林，清真認證是否必需，視各國規範，在清真客群中，認證可提升產品價值（非指售價）增加選購意願，但若目標市場並非穆斯林，如「穆斯林國家」中的華人市場，則清真認證的必要性較低。</span></span></p>\n\n<p>&nbsp;</p>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">有關各國清真驗證現況、清真認證程序，可參考經濟部貿易局 2017年3月出版的「清真認證重點研析報告」：<a href=\"https://mvp-plan.cdri.org.tw/upload/other/20170911/7f2190e288884705bb3845f7accf6448/7f2190e288884705bb3845f7accf6448.pdf\" target=\"_blank\">附件下載網頁</a></span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">參考外貿協會「<a href=\"https://thpc.taiwantrade.com/\" target=\"_blank\">台灣清真推廣中心</a>」資料:</span></span></li>\n</ol>\n\n<ul style=\"margin-left:80px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">為臺灣清真產業推廣的中樞，政府與業者拓銷清真市場的統一窗口，整合清真市場經貿訊息，執行清真市場拓銷、交流合作各項計劃。</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">清真認證暨推廣輔導作業規範 (政府優惠方案)</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">清真認證申請流程:</span></span></li>\n</ul>\n\n<p style=\"margin-left:80px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><img alt=\"\" src=\"/pic/images/%E9%A3%9F%E5%93%811.jpg\" /></span></span></p>\n\n<ul style=\"margin-left:80px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">台灣國內清真驗證單位</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">東協各國清真認證單位</span></span></li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">三、一般食品、冷凍食品</span></span></h2>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">就一般的食品與農產品檢驗規定，美國農業部(USDA)有定期出版全球主要國家的「食品及農產品進口規定與標準」(Food and Agricultural Import Regulations and Standards)。多數國家的報告每年均修訂一次，算是相當即時的資訊。</span></span></li>\n</ol>\n\n<ul style=\"list-style-type:square; margin-left:80px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">USDA報告搜尋的方式有兩種</span></span></li>\n</ul>\n\n<ol start=\"1\" style=\"list-style-type:upper-alpha; margin-left:80px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">以前述英文名稱，再加上國名(如馬來西亞Malaysia)，在Google搜尋，通常出現的第一筆資料(報告為pdf檔)即是。</span></span></li>\n</ol>\n\n<p style=\"margin-left:120px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">前述USDA所彙整各國進口規定資料，均為英文版。如有需要，請利用「Google翻譯」功能，將整份PDF檔自英文譯為中文。</span></span></p>\n\n<ol start=\"2\" style=\"list-style-type:upper-alpha; margin-left:80px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">另一種方式，是在<a href=\"https://gain.fas.usda.gov/#/search\" target=\"_blank\">USDA資料檢索的官網</a>直接搜尋</span></span></li>\n</ol>\n\n<ul style=\"margin-left:120px\">\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\">先至主頁點選Search</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">接著可在畫面左側的Categories(類別)勾選「Food and Agricultural Import Regulations and Standards Reports」</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">畫面右側的Countries則勾選欲查詢的國家</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">再按Search即可</span></span></li>\n</ul>\n\n<ol start=\"2\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><a href=\"https://www.fda.gov/food\" target=\"_blank\">美國食品藥物管理局(FDA)</a>對於食品的管理規定</span></span></li>\n</ol>\n\n<ul style=\"margin-left:80px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">包括一般食品及健康食品(Dietary supplements)</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">舉凡一般食品的成分標示及包裝(Ingredients &amp; Packaging)，以及健康食品的標示及營養成分(Label Nutrition)，FDA網頁均有詳細說明。</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">FDA網頁僅有英文版。如有需要瀏覽中文，可以利用Google Chrome瀏覽器，並啟動自動翻譯功能。</span></span></li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">四、蔬菜、水果、菸草等植物產品出口</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">有關全球各國相關檢疫規定，可參閱行政院農業委員會動植物防疫檢疫局所架設之「<a href=\"https://export.baphiq.gov.tw/coa/plantsearch2_idx.php\" target=\"_blank\">對外貿易植物檢疫查詢系統</a>」</span></span></p>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">農業委員會/動植物防疫檢疫局所認定的「植物」，以稻米、蔬菜及水果等天然食材為主，如：茶葉因經過烘培等加工程序，不在該局管轄範圍內，故無法以該局的資料庫查詢各國進口相關規定。</span></span></p>\n',	'',	'',	'外國食品規定,USDA,FDA,清真推廣中心,線上諮詢',	NULL,	'2021-06-07',	'2021-06-07 03:03:23'),
(12,	'工業製品',	'',	'2021-03-19 11:02:42',	10,	1,	NULL,	0,	1,	800,	'https://www.fda.gov/',	'https://www.moeaidb.gov.tw/view/rwd_tw/',	'',	'',	'',	'601a30a07cdac.jpg',	'601a317d319eb.png',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、美妝品</span></span></h2>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">美國食品藥物管理局(FDA)對於化妝品的<a href=\"https://reurl.cc/9XN5na\" target=\"_blank\">管理規範</a></span></span></li>\n</ol>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">尚有化妝品(Makeup)、美甲產品(Nail Care Products)、肥皂及乳液(Soap &amp; Lotions)等細分類，各類產品於FDA網頁均有詳細說明。</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">FDA網頁僅有英文版。如有需要，可以Google Chrome瀏覽，並啟動自動翻譯功能。</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">美妝保養品進口至美國之FDA<a href=\"https://www.fda.gov/media/94786/download\" target=\"_blank\">參考資訊</a> (中文)</span></span></li>\n</ul>\n\n<ol start=\"2\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">東協各國</span></span></li>\n</ol>\n\n<p style=\"margin-left:80px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">可參考經濟部工業局2020年9月出版的「<a href=\"https://www.cosmetic.org.tw/images/download/2020.pdf\" target=\"_blank\">東協化妝品出口手冊</a>」。該份報告厚達410頁，對於東協10個會員國進口美妝品相關規定與流程，均有詳細介紹。</span></span></p>\n\n<ol start=\"3\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">歐盟</span></span></li>\n</ol>\n\n<p style=\"margin-left:80px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">可參考經濟部工業局2015年12月出版的「<a href=\"https://www.cosmetic.org.tw/images/file/2016030302.pdf\" target=\"_blank\">出口化妝品至歐盟法規與程序</a>」。該份報告內文計40頁，對於歐盟美妝品進口規定，均有詳細介紹。</span></span></p>\n\n<ol start=\"4\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">中國大陸</span></span></li>\n</ol>\n\n<p style=\"margin-left:80px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">可參考經濟部工業局2015年12月出版的「<a href=\"https://www.cosmetic.org.tw/images/file/2016030301.pdf\" target=\"_blank\">出口化妝品至大陸地區法規與程序</a>」。該份報告內文計81頁，對於中國大陸美妝品進口規定有詳細介紹。</span></span></p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">二、醫療器材</span></span></h2>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">&nbsp;美國食品藥物管理局(FDA)對於醫療器材的<a href=\"https://www.fda.gov/medical-devices\" target=\"_blank\">管理規範</a></span></span></li>\n</ol>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">有相當詳盡的說明，並且盡量將繁複規定以淺顯易懂，近似懶人包的方式呈現。</span></span></li>\n</ul>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">三、利用ITC資料庫<a href=\"https://www.macmap.org/\" target=\"_blank\">Market Access Map</a> 查詢各國進口規定</span></span></h2>\n\n<ul style=\"margin-left:40px\">\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">查詢各國針對特定產品進口的進口關稅，以及有無特殊進口規定(本資料庫為英文版，如須以中文閱覽，請以Google Chrome瀏覽，並將網頁譯為英文)</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">查詢方式請參照本章第二節「外國進口關稅」有關ITC資料庫Market Access Map的查閱說明。</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">如該資料庫獲得訊息，該國自台灣進口特定產品，有特殊進口限制(Regulatory requirements)，建議可向1.所屬產業公會 2.我國派駐該國代表處經濟組查詢。</span></span></li>\n</ul>\n',	'',	'',	'外國進口規定,工業製品,線上諮詢',	NULL,	'2021-06-07',	'2021-06-07 03:04:04'),
(13,	'篩選目標市場',	'',	'2021-02-08 10:35:05',	2,	1,	NULL,	0,	1,	900,	'https://itrade.taiwantrade.com/',	'https://www.intracen.org/itc/market-info-tools/trade-statistics/',	'',	'',	'',	'601a329f70977.jpg',	'601a32be0167c.png',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、<a href=\"https://itrade.taitra.org.tw/\" target=\"_blank\">iTrade</a> (全球貿易大數據平台)</span></span></h2>\n\n<ol start=\"1\" style=\"list-style-type:decimal\">\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\">&nbsp;本平台係經濟部國際貿易局主辦，外貿協會執行，惟需加入外貿協會會員才可使用相關服務。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">「iTrade」透過趨勢及圖表分析，協助廠商輕鬆解析複雜的統計數據，即時觀察產品的出口變化，掌握全球市場動態，進一步找出潛力市場。平台也提供貼心的下載服務，一鍵打包分析資料簡便又快速！貿協 iTrade 是您掌握貿易先機的最佳工具。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">產品／產業進出口情勢：查詢產品／產業於目標市場貿易金額、成長率等指標分析及趨勢分析。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">市場情勢：查詢目標市場產品貿易額、經貿指標分析。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">雙軌數據服務：客製化需求可洽詢專人服務。</span></span></li>\n</ol>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">二、利用經濟部國際貿易局「<a href=\"https://cuswebo.trade.gov.tw/\" target=\"_blank\">中華民國進出口貿易統計資料庫</a>」</span></span></h2>\n\n<ol start=\"1\" style=\"list-style-type:decimal\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">如欲自行查閱最即時的台灣進出口貿易統計資料，請參考以下步驟：</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">於該頁面左側「貿易統計查詢」欄，點選第3項「進出口值表(按國別)」。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">出現新的畫面後，「進出口別」點選「出口」</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">「貨品號列」鍵入H.S. Code (可依個別需求，填列產品4碼、6碼、8碼或10碼號列)</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">「報表類別」點選「同期比(國家)」</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">國家地區」點選「全球_國別」</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">「比較值」已先設定「增減比」</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">「日期間距」已先設定「月(含年)」</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">「計量單位」已先設定「金額(美元)」</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">「金額單位」已先設定「美元」</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">&nbsp;鍵入「驗證碼」都填好後，按下「開始查詢」</span></span></li>\n</ol>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">三、利用外貿協會付費資料庫Global Trade Atlas (查詢各國進口統計資訊)。</span></span></h2>\n\n<ul>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">除前述2的我國經濟部國際貿易局統計查詢系統，其他國家的統計資料，網站上很難蒐尋得到。即使有，經常資料不即時，或是查閱很不順手，所以才會有Global Trade Atlas這個資料庫。這家公司向全球各國海關購買統計資料，匯入自己的運算系統，再對外販售。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">該資料庫屬會員付費使用，一般廠商無法自行檢索，建議可至外貿協會「電子資訊專區」(台北世貿中心二樓2C03室)，以及貿協桃園、新竹、台中、台南及高雄等各地區辦事處，利用Global Trade Atlas資料庫，查閱及列印各國進出口資料。</span></span></li>\n</ul>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">四、<a href=\"https://www.intracen.org/itc/market-info-tools/trade-statistics/\" target=\"_blank\">ITC免費資料庫</a>&nbsp;</span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">使用&nbsp;ITC免費資料庫，需經過簡單程序註冊會員，即可使用資料庫。</span></span></p>\n',	'',	'',	'篩選目標市場,市場開發,貿易大數據,線上諮詢',	NULL,	'2021-06-07',	'2021-06-07 03:05:13'),
(14,	'市場拓展',	'',	'2021-02-04 13:14:03',	2,	0,	NULL,	0,	1,	800,	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	NULL,	NULL,	NULL,	'',	'',	'',	'',	NULL,	'2021-02-04',	'2021-02-04 05:14:03'),
(15,	'買主資料蒐集',	'',	'2021-03-19 11:05:20',	14,	1,	NULL,	0,	1,	900,	'https://info.taiwantrade.com/bizexchange/#menu=11609',	'https://southernstarclub.taiwantrade.com/threads/welcome',	'',	'',	'',	'601a351764ed2.png',	'601a3587197e5.png',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、可直接引導至「<a href=\"https://www.taitraesource.com/\" target=\"_blank\">貿協全球資訊網</a>」</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">該資訊網提供之經貿資料係屬年報，每年於7、8月陸續更新，目前持續更新中。計有亞太(36國)、中東(15國) 、歐洲(47國) 非洲(40國) 美洲(35國)，總計173國經貿資料。</span></span></p>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">在首頁設定「洲別」及「國家」後，按Return。</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">出現新畫面，在左側欄「貿易實務資料」點選「進出口廠商」，即有豐富資料。</span></span></li>\n</ol>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">二、建議可向貿協<a href=\"https://www.taitra.org.tw/iframe.aspx?n=10\" target=\"_blank\">駐外單位</a>索取駐地潛在買主名單</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">外貿協會目前在全球63個城市設有行銷據點。我國廠商可以電子郵件(中、英文均可)向駐外單位提出明確需求，表明欲查詢駐地目標潛在買主資料。除了當地連假或外館有重大活動舉辦較忙碌等因素，通常廠商一週內可接獲駐外單位回函。</span></span></p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">三、外貿協會「<a href=\"https://info.taiwantrade.com/bizexchange/#menu=11609\" target=\"_blank\">台灣經貿網</a>」商機</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">以貿協新接受到的商機資訊為主，目前主要分為兩部分：</span></span></p>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-family:Arial,Helvetica,sans-serif; font-size:20px\">全球採購洽談</span>：<span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">登錄新南向、亞洲、歐洲、美洲等各區域買主參加貿協主辦洽談會訊息。此部分之買主均為外貿協會或經濟部、外交部駐外單位推介。</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">最新商機</span></span>：<span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">此部分者要是國外買主於「台灣經貿網」所登錄之最新採購訊息，非透過外貿協會駐外單位推介。</span></span></li>\n</ol>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">四、外貿協會「<a href=\"https://southernstarclub.taiwantrade.com/threads/welcome\" target=\"_blank\">指南星俱樂部</a>」潛在買主名單</span></span></h2>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">目前該網頁有緬甸、斯里蘭卡、新加坡、印尼、越南及泰國等6個新南向國家的買主名單。</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">瀏覽該網頁須先加入「TAITRA會員」(企業會員)</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">加入會員並登錄後，於首頁左上角，點選「<a href=\"https://southernstarclub.taiwantrade.com/threads/downloads\" target=\"_blank\">資料下載</a>」</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">各國的潛在買主名單，尚有依產業分類。</span></span></li>\n</ol>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">五、美國買主資料可參考<a href=\"https://www.thomasnet.com/\" target=\"_blank\">THOMAS資料庫</a>(免費檢索)</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">該資料庫內容相當豐富，可直接以產品名稱搜尋</span></span></p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">六、歐盟國家、俄羅斯、土耳其等買主資料，可參考<a href=\"https://www.europages.co.uk/\" target=\"_blank\">EUROPAGES資料庫</a>(免費檢索)</span></span></h2>\n\n<ol style=\"margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">先選取網頁語言，建議仍點選國際通用的英文版較流暢</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">可直接以產品名稱搜尋。另網頁左側尚有「By Category」欄位，予以更細部的劃分，參考價值高。</span></span></li>\n</ol>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">七、「貿協書廊」付費資料庫</span></span></h2>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">目前提供下列兩項資料庫</span></span></li>\n</ol>\n\n<ul style=\"margin-left:80px\">\n	<li value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">KOMPASS廠商資料庫。總計68國約500萬家廠商名錄，此資料庫提供外國廠商Email、網址。</span></span></li>\n	<li value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">美國進口通關資料(US Waterborne Import Database)。此資料庫僅有公司名稱及地址，無採購人員的Email。</span></span></li>\n</ul>\n\n<ol start=\"2\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">廠商使用該兩項資料庫，需支付連線費及資料列印費用。</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">廠商如有興趣，可洽詢貿協下列單位</span></span></li>\n</ol>\n\n<ul style=\"margin-left:80px\">\n	<li value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">貿協書廊「電子資訊專區」台北世貿中心二樓2C03室)&nbsp;Tel: 02-27255200&nbsp; 分機1422, 2263</span></span></li>\n	<li value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">外貿協會桃、竹、中、南、高等各地區辦事處</span></span></li>\n</ul>\n',	'',	'',	'買主資料收集,買主名單,數位貿易及電子商務,線上諮詢',	NULL,	'2021-06-07',	'2021-06-07 03:08:49'),
(16,	'外貿協會拓銷活動',	'',	'2021-03-19 11:06:42',	14,	1,	NULL,	NULL,	1,	700,	'https://events.taiwantrade.com/',	'https://isourcing.taiwantrade.com/home',	'',	'',	'',	'601a35d55501a.png',	'601a35e6ca06f.png',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、外貿協會各項推廣活動彙整</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><a href=\"https://events.taiwantrade.com/\" target=\"_blank\">活動匯</a>：</span></span><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">外貿協會辦理之海內外展覽、洽談會、培訓課程等活動資訊。</span></span></p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">二、參加外貿協會辦理的買主洽談會</span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><a href=\"https://isourcing.taiwantrade.com/home\" target=\"_blank\">採洽易</a>：</span></span><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">貿協舉行各式洽談會，如視訊採購洽談、買主來臺採購洽談、採購商機說明會、展覽洽談會及商機日等，透過採洽易為臺灣廠商提供一站式完整服務。</span></span></p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">三、專案拓銷</span></span></h2>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">國際市場開發專案Plus (IMD Plus)專案：<a href=\"https://events.taiwantrade.com/imdplus\" target=\"_blank\">報名網址</a></span></span></li>\n</ol>\n\n<p style=\"margin-left:80px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">為協助廠商拓銷海外市場，特別針對廠商個別需要，推出IMD Plus客製化服務。本專案由貿協國際行銷諮詢中心及駐外單位提供具體評估意見，並透過駐外單位協助開發市場買主，引介委辦廠商進行媒洽。媒洽可透過雙方直接洽商或透過視訊方法辦理，視需要亦可接受委辦廠商洽邀陪同拜會海外買主。詳細內容請參閱該項活動之作業規範。</span></span></p>\n\n<ol start=\"2\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">小型機動拓銷團：<a href=\"https://events.taiwantrade.com/TRA2GM-2021\" target=\"_blank\">報名網址</a></span></span></li>\n</ol>\n\n<p style=\"margin-left:80px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">本團特色為快速成行、依需求安排洽談，洽談地點具彈性。活動主要於外貿協會63 個駐外單位所在國辦理，利用台貿中心深耕當地之便利優勢，以機動、客製化方式，協助安排廠商與海外買主進行面對面洽談。1家即可成行，以更具彈性之方式服務業者。(受到新冠疫情影響，目前改採線上洽談)。</span></span></p>\n\n<ol start=\"3\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">台灣商品行銷中心(<span style=\"background-color:white\">(Taiwan Product Center，簡稱TPC)：<a href=\"https://events.taiwantrade.com/TPC2021\" target=\"_blank\">報名網址</a></span></span></span></li>\n</ol>\n\n<p style=\"margin-left:80px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">TPC為外貿協會受貿易局委託執行，以Uber共享的概念，利用外貿協會駐印度（新德里、孟買、清奈）、馬來西亞與印尼的台灣貿易中心為據點，5位廠商一起僱用一位具有銷售背景的當地人員作為您在當地的銷售代表，由貿協駐點主任幫您管理，還定期向您回報成果!該名銷售代表主要工作包括提供業者市場商情，主動接洽與拜訪潛在買主，同時藉由參加當地活動等方式，加強宣傳臺灣商品優勢，協助業者尋找當地合作夥伴並拓銷市場。</span></span></span></p>\n\n<ul style=\"margin-left:80px\">\n	<li value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">徵集產業：優先徵集電機電子、資通訊、機械、五金、手工具、扣件、醫療器材、汽機車零配件等產業參加。</span></span></span></li>\n</ul>\n',	'',	'',	'外貿協會,活動匯,採洽易,IMD PLUS,台灣商品行銷中心,線上諮詢',	NULL,	'2021-06-07',	'2021-06-07 03:10:04'),
(17,	'海外布局',	'',	'2021-03-19 11:08:07',	14,	1,	NULL,	NULL,	1,	800,	'https://investtaiwan.nat.gov.tw/twBusiness?lang=cht',	'https://www.imdp.org.tw/index.php',	'',	'',	'',	'601a36bc0552d.png',	'601a36cb9b333.jpg',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、經濟部 <a href=\"https://investtaiwan.nat.gov.tw/twBusiness?lang=cht\" target=\"_blank\">InvesTaiwan</a></span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">參考經濟部InvesTaiwan全球布局網頁</span></span></p>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">先於首頁點選「對外投資」</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">再依洲別點選「各國投資環境」</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">即可下載全球6大洲計88國的投資環境簡介專刊</span></span></li>\n</ol>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">二、我國駐當地經濟組以及外貿協會駐外單位</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">另可與我國駐當地經濟組以及外貿協會駐外單位聯繫，瞭解最新投資相關訊息，並可引介當地重要且熱心的台商人脈。相關聯繫資訊可參考各國投資簡介「附錄一&nbsp;&nbsp; 我國在當地駐外單位及台商團體」</span></span></p>\n\n<p style=\"margin-left:40px\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">三、各國駐台機構</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">其官方網頁多有該國經貿發展資訊，以招商引資。敬請參考外交部「駐台外國機構」之<a href=\"https://www.mofa.gov.tw/OfficesInROC.aspx?n=169&amp;sms=86\" target=\"_blank\">收錄名址</a>。</span></span></p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">四、更多世界各國投資相關訊息</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">如希望瞭解更多世界各國投資相關訊息，全球四大會計事務所(KPMG, Deloitte, PwC, EY)，以及具財經專長的律師事務所Baker &amp; McKenzie，多會針對這些個別國家提供投資環境介紹，名稱通常為Doing Business in,,,.(國家名稱)，這些報告內容精闢豐富，惟均為英文版。</span></span></p>\n\n<ul>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">敬請直接在網路上以關鍵字「Doing business in Russia」(以俄羅斯為例) 搜尋。</span></span></li>\n</ul>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">五、經濟部貿易局專案「<a href=\"https://www.imdp.org.tw/index.php\" target=\"_blank\">補助業界開發國際市場計畫</a>」</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">另廠商如係「布建海外行銷通路」(包括設立分公司、子公司、展示中心、發貨倉庫或其他類似性質之據點及洽覓代理商/經銷商等)，可申請經濟部貿易局專案「補助業界開發國際市場計畫」。廠商可於計畫中提出具多元、創新之手法 或能發揮整合性⾏銷效益之加值作法，惟補助範圍排除參展、拓銷團及買主媒合等推廣活動，詳情請參閱官網。</span></span></p>\n',	'',	'',	'海外布局,各國投資,補助業界開發國際市場計畫,線上諮詢',	NULL,	'2021-06-07',	'2021-06-07 03:10:16'),
(18,	'網路行銷',	'',	'2021-03-19 14:29:08',	3,	1,	NULL,	NULL,	1,	900,	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、<a href=\"https://exportadv.chun-mu.com/video\" target=\"_blank\">外貿協會「數位行銷服務團」資料分享影音檔</a></span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">經濟部國際貿易局與外貿協會，為幫助業者突破疫情帶來交易模式的改變，於2020年8月至11月期間，辦理12場「數位行銷服務團」，巡迴全台各地推廣。</span></span></p>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">目前該活動雖已圓滿結束，但是全程影音檔目前可在Youtube頻道觀賞。如有興趣，可在Youtube搜尋「外貿協會TAITRA」頻道，進入後在「撥放清單」選項，點選「數位列車」，即可找到這12場活動的影音檔，並依據各講者的演講主題重新編輯，以便於搜尋。</span></span></p>\n\n<h3 style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">該12場活動，貿協均邀請數位行銷領域的專家，與觀眾分享。相關講題包括：</span></span></h3>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">數位行銷成功案例</span></span></li>\n</ol>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">樹德企業等約廿家廠商分享自身經驗</span></span></li>\n</ul>\n\n<ol start=\"2\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">品牌行銷</span></span></li>\n</ol>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">新品牌如何用6個月實現月百萬業績</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">幫商品說故事</span></span></li>\n</ul>\n\n<ol start=\"3\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">社群媒體(FB)行銷</span></span></li>\n</ol>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">透過FB行銷經營 讓消費者看到你</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">社群文案力</span></span></li>\n</ul>\n\n<ol start=\"4\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">影音行銷</span></span></li>\n</ol>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">數位時代 行銷文案與影音內容創意</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">5G影音行銷時代</span></span></li>\n</ul>\n\n<ol start=\"5\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">網紅行銷</span></span></li>\n</ol>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">善用網紅行銷提高產品吸睛量</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">網紅行銷加速提升產品能見度</span></span></li>\n</ul>\n\n<ol start=\"6\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Google工具</span></span></li>\n</ol>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">外貿網站如何利用Google Analytics拓展業績</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">數位廣告入門-搜尋廣告、多媒體廣告</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Google數位工具--我的商家</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">如何透過GA衡量數位行銷成效</span></span></li>\n</ul>\n\n<ol start=\"7\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">搜尋引擎(SEO)優化</span></span></li>\n</ol>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">善用SEO整合O2O行銷</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">內容經營SEO優化公司「數位資產」</span></span></li>\n</ul>\n\n<ol start=\"8\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">關鍵字</span></span></li>\n</ol>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">如何在網路上被找到-關鍵字選擇與使用</span></span></li>\n</ul>\n\n<ol start=\"9\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">數位行銷概論</span></span></li>\n</ol>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">解放數位行銷戰鬥力</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">數位行銷三部曲</span></span></li>\n</ul>\n\n<p style=\"margin-left:33px; text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">二、<a href=\"https://digitalcommerce.taiwantrade.com/education.html\" target=\"_blank\">台灣經貿網數位貿易學苑&nbsp;</a></span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">此數位學苑主要協助業者突破全球貿易困境、迎接數位貿易商機；包括跨境電商、數位行銷、數位轉型、數位商務等四大主題；並提供實體、線上學習、操作體驗等方式進行課程。</span></span></p>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">本學苑仍持續推出新課程。已開辦課程，也可點選、開啟影音檔瀏覽(需先加入貿協會員)。</span></span></p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">三、外貿協會數位行銷主題推廣課程</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">外貿協會國際企業人才培訓中心(台北)以及桃、竹、中、南、高等各地區辦事處亦不定期開設數位行銷主題推廣課程，服務在地廠商。</span></span></p>\n\n<h3 style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">例如：<a href=\"https://taichung.taiwantrade.com/note/detail?id=1297\" target=\"_blank\">貿協台中辦事處</a>2021年下半年即規畫開設下列課程：</span></span></h3>\n\n<h3 style=\"margin-left:40px\">&nbsp;</h3>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Google Ads操作實務 (7/22)</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">手機影片拍攝實戰&mdash;產品介紹操作拍攝技巧 (7/30）</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">網路行銷實作(8/11, 8/18)</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">FB廣告行銷實戰班 (8/18)</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Youtube影音自媒實戰班(8/30, 9/6)</span></span></li>\n</ul>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">請瀏覽各辦事處官網，或貿協「活動匯」網頁。</span></span></p>\n',	'',	'',	'數位貿易,網路行銷,數位行銷,線上諮詢',	NULL,	'2021-06-07',	'2021-06-07 03:18:15'),
(19,	'電子商務',	'',	'2021-03-19 13:56:21',	3,	1,	NULL,	NULL,	1,	800,	'https://info.taiwantrade.com/index/service_description',	'',	'',	'',	'',	'601a479130a00.png',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">一、加入外貿協會<a href=\"https://info.taiwantrade.com/index/service_description\" target=\"_blank\">台灣經貿網尊爵會員</a></span></span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">提供最新企業網經營現況儀表板，1分鐘掌握關鍵數據!!!</span></span></span></p>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">「營運總覽」讓您查看網站最近30天營運重點資訊，變身企業網經營達人，掌握企業網關</span> <span style=\"background-color:white\">鍵數據！</span></span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">「流量分析」提供您各式報，一次掌握企業網的各方面流量來源及流量表現，透析網站流</span> <span style=\"background-color:white\">量從哪來，有效佈局行銷資源！</span></span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">「買主行為」供您隨時查看各類商機變化趨勢，並剖析買主喜好，讓您精準優化企業網，</span> <span style=\"background-color:white\">接獲商機再提升。</span></span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">「</span> <span style=\"background-color:white\">產業分析」提供各式報表，讓您瞭解同行企業網的表現，掌握所屬產業買主的最新採購需求。</span></span></span></li>\n</ul>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">二、台灣經貿網「<a href=\"https://info.taiwantrade.com/idealez/about#menu=1513106\" target=\"_blank\">買賣旺</a>」</span></span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">台灣經貿網掌握電子商務脈動，看中網路購物市場逆勢成長的力道強勁，傾力打造買賣商城「台灣經貿網買賣旺」，帶您跨足B2B2C線上交易模式，搶攻全球線上商機。</span></span></span></p>\n\n<p style=\"margin-left:33px; text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">三、台灣經貿網「<a href=\"http://info.taiwantrade.com/index/ecplatform\" target=\"_blank\">入駐國際平台服務-前進主流電商平台</a></span><a href=\"http://info.taiwantrade.com/index/ecplatform\" target=\"_blank\"> </a><span style=\"background-color:white\"><a href=\"http://info.taiwantrade.com/index/ecplatform\" target=\"_blank\">搶攻全球跨境商機</a>」</span></span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">隨著電商平台逐漸成為普遍的網路行銷工具，從傳統零售或貿易業者轉型為跨境電商的廠商日漸增加，但電商的管理必須朝數據化、國際化、在地化、自動化、體驗化方向，才有機會打入目標市場。</span></span></span></p>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">目前台灣經貿網與多家國際跨境電商平台合作，包括美國最大電商平台Amazon、印尼blibli台灣館、美國新蛋網Newegg、印度最大B2B平台Tradeindia 、越南最大本土B2C電商平臺Tiki、日本樂天台灣館等，建議可考慮與目標市場電商作策略聯盟，以順利切入該市場。</span></span></span></p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">四、外貿協會「<a href=\"https://gd.taiwantrade.com/\" target=\"_blank\">數位基地</a>」</span></span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">鑑於運用數位科技推升貿易發展的趨勢銳不可擋，外貿協會推出了「數位基地」網站，聚焦數位行銷與跨境電商領域，為臺灣中小企業植入數位DNA，加速數位轉型。</span></span></span></p>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">「數位基地」透過清楚易懂的電商戰力自我檢測機制，幫助企業了解目前跨足電商的準備程度，並針對企業不同的準備程度、現況與需求，循序漸進提供相對應的資源與輔導，幫助仍在觀望的廠商跨出第一步，協助已有基礎電商實力的廠商加速佈局，也為力求突破的廠商增添量能，希望透過提供貼近企業需求的服務，全面提升臺灣廠商電商爆發力。</span></span></span></p>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">3大服務主軸</span></span></li>\n</ul>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:120px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">尋良醫：<span style=\"background-color:white\">覺得無助嗎？「電商產業環節專業服務商」讓您縮短學習曲線。</span></span></span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">得藥方：<span style=\"background-color:white\">名師開講、團體諮詢、媒合會、研討會等活動可聚焦主題、互動激盪，帶您一起找解答。</span></span></span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">長知識：<span style=\"background-color:white\">想順勢而起嗎？市場脈動、產業新知、名家分析、時下議題有助於持續打底，蓄積能量，陪您一起找方向。</span></span></span></span></li>\n</ol>\n\n<h2 style=\"text-align:justify\">&nbsp;</h2>\n\n<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">五、台灣經貿網「<a href=\"https://anti-epidemic.taiwantrade.com/\" target=\"_blank\">台灣防疫國家館</a>」</span></span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\"><span style=\"background-color:white\">外貿協會透過數位工具，把台灣的防疫產業生態系，從前端的疾病檢測、病毒測試，到後端的智慧醫療，全部整合在一起，打造線上防疫國家館。</span></span></span></span></p>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\"><span style=\"background-color:white\">平台整合超過2000家防疫醫材企業，超過萬件MIT的商品，提供的服務包含共享防疫資訊、推廣台灣防疫產業，到協助國際買家下單，打造一站式的台灣醫療數位平台，在疫情之下成為另一支國家隊。</span></span></span></span></p>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\"><span style=\"background-color:white\">透過「台灣防疫國家館」數位平台連接國際，不但能在疫情期間拓展商機，疫情結束後轉型成台灣國際醫療平台，持續協助台灣醫材開拓國際市場。</span></span></span></span></p>\n\n<p>&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">六、外貿協會「數位行銷服務團」電子商務資料分享影音檔</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">經濟部國際貿易局與外貿協會，為幫助業者突破疫情帶來交易模式的改變，於2020年8月至11月期間，辦理12場「數位行銷服務團」，巡迴全台各地推廣。</span></span></p>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">目前該活動雖已圓滿結束，但是全程影音檔目前可在Youtube頻道觀賞。如有興趣，可在Youtube搜尋「外貿協會TAITRA」頻道，進入後在「撥放清單」選項，點選「數位列車」，即可找到這12場活動的影音檔。</span></span></p>\n\n<h3 style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">該系列活動，除數位行銷領域，亦邀請電子商務專家與觀眾分享。相關講題包括：</span></span></h3>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">電商上架經營實務</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">運用跨境電商，鏈結全球商機</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">跨境電商趨勢指南</span></span></li>\n</ul>\n',	'',	'',	'數位貿易,電子商務,數位行銷服務團,線上諮詢',	NULL,	'2021-06-07',	'2021-06-07 03:48:10'),
(20,	'對國際貿易流程不熟悉；缺乏實務經驗',	'',	'2021-03-19 13:57:29',	4,	1,	NULL,	NULL,	1,	900,	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、外貿協會「<a href=\"https://events.taiwantrade.com/INTERD109-0\" target=\"_blank\">貿易經營實務入門課程</a><span style=\"background-color:white\">」</span></span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">參加外貿協會所開設貿易經營實務入門課程，</span></span><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">貿協培訓中心台北校區(台北世貿中心2 樓)</span> 為非科班出身但有意從事國際貿易相關工作者量身打造，將國貿須知如資訊流、金流及物流作全盤系統化介紹，幫助廠商迅速上手貿易經營實務。</span></span></p>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">這項課程通常利用平常日的晚間，或是周末假日白天上課。整個課程規劃30小時。以晚間班為例，每年約有5個梯次可選擇，相當具彈性。</span></span></span></p>\n\n<p style=\"margin-left:88px; text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">二、外貿協會國際貿易實務課程</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">除了前述<span style=\"background-color:white\">貿協培訓中心台北校區所開設課程，</span>另外貿協會各地區辦事處(桃、竹、中、南、高)亦不定期開設國際貿易實務課程，服務在地廠商。例如：貿協<a href=\"https://tainan.taiwantrade.com/event/list\" target=\"_blank\">台南辦事處</a>2021下半年即規畫開設下列貿易實務入門相關課程：</span></span></p>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">出進口貿易單據製作、審核實務入門班 (7/21)</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">國貿中如何「報價」及其技巧(10/19)</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">三角貿易實務操作入門班 (10/27)</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">老手帶路一次弄懂海關的查驗與通關(11/16)</span></span></li>\n</ul>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">請瀏覽各辦事處官網，或貿協「活動匯」網頁。</span></span></p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">三、張錦源先生編撰的「<a href=\"https://www.sanmin.com.tw/Product/index/006970391\" target=\"_blank\">國際貿易實務詳論21版</a>」</span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">本書按交易過程先後作有條理的說明，期使讀者能獲得一完整的概念，包含出貨前的交易條件、進出口價格計算、報價、貿易契約簽訂等。除了進出口貿易外，本書對於託收、轉口貿易、整廠輸出、經銷代理、寄售等特殊貿易，亦有深入淺出的介紹，另也包含電子信用狀統一慣例、本金／無本金交割遠期外匯等最新內容。</span></span></p>\n',	'',	'',	'國際貿易,商業貿易,線上諮詢',	NULL,	'2021-06-07',	'2021-06-07 03:23:31'),
(21,	'精進商用英文及其他外語能力',	'',	'2021-03-19 13:58:40',	4,	1,	NULL,	NULL,	1,	800,	'https://www.iti.org.tw/?go=teacher&cid=40',	'',	'',	'',	'',	'601a47ff7262c.png',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、利用外貿協會的外籍講師製作影片學習</span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">貿協培訓中心外籍講師針對社交英文、英文片語、生活英文、英文商務慣用語、英文發音及英文常見錯誤等主題，錄製數十支影片，提供有志學習英文的人士參考。</span></span></p>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">請於<a href=\"https://www.iti.org.tw/index.php\" target=\"_blank\">首頁</a>點選「學習專區」，再點選「ITI English」影片。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">前述「學習專區」亦有泰語、印尼語、越南語及緬甸語之教學影片。請至該專區再點選「ITI ASEAN」影片。</span></span></li>\n</ol>\n\n<p style=\"margin-left:33px; text-align:justify\">&nbsp;</p>\n\n<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">二、外貿協會商用英文及外語課程</span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">另外貿協會國際企業人才培訓中心(台北)以及桃、竹、中、南、高等各地區辦事處亦不定期開設商用英文或英語，以及東南亞語言課程，服務在地廠商。例如：貿協<a href=\"https://events.taiwantrade.com/KH20210000\" target=\"_blank\">高雄辦事處</a>2021年下半年即規畫開設語文相關課程：</span></span></p>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">B2B貿易英語談判技巧 (7/7)</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">貿易必備英語力(8/10, 8/17)</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">國外業務商用英文實戰班(10/20)</span></span></li>\n</ul>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">請瀏覽各辦事處官網，或貿協「活動匯」網頁。</span></span></p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">三、<a href=\"https://www.iti.org.tw/?go=teacher&amp;cid=40\" target=\"_blank\">貿協培訓中心(ITI)線上課程</a></span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">為協助國內業者奠定穩健之商務英語能力，外貿協會培訓中心(ITI)於新冠肺炎防疫期間特推出多項線上英文學習課。</span></span></p>\n\n<p>&nbsp;</p>\n',	'',	'',	'商用英文,外語課程,外貿協會,線上諮詢',	NULL,	'2021-06-07',	'2021-06-07 03:48:43'),
(22,	'貿易糾紛；付款及收帳問題',	'',	'2021-02-08 10:48:59',	4,	1,	NULL,	NULL,	1,	700,	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、尋求協調管道</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">我國廠商與國外廠商，由於貨品出口貿易而衍生之糾紛 ，欲尋求協調處理者，有何管道？</span></span></p>\n\n<ul style=\"margin-left:80px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">有兩種方法：</span></span></li>\n</ul>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:120px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">中外當事人直接洽請協助：經濟部貿易局「貿易服務組」負責出口貿易糾紛之協調處理，我國出口商與國外廠商雙方各對貨款、買賣貨品有所爭議，均可來函直接請求必要之協助。&nbsp;</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">透過國內外有關單位函轉協助：買賣雙方政府機關、及我國駐外機構、經貿單位接到廠商因出口貿易糾紛請求協助，皆可轉請經濟部貿易局予以協助。</span></span></li>\n</ol>\n\n<p style=\"margin-left:120px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">以上資料來源:&nbsp;經濟部 InvesTaiwan「<a href=\"https://investtaiwan.nat.gov.tw/faqQContent?lang=cht&amp;search=91\" target=\"_blank\">投資台灣</a>」官網</span></span></p>\n\n<p>&nbsp;</p>\n\n<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">二、國際貿易糾紛案例解析研討會</span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">經濟部國際貿易局不定期辦理「國際貿易糾紛案例解析研討會」。例如：2020年11月13日在屏東，11月25日在彰化，12月4日在台南均有辦理相關課程。相關活動訊息請參考中華民國仲裁協會「<a href=\"http://www.arbitration.org.tw/news2Con.php?seqno=35\" target=\"_blank\">活動訊息</a>」</span></span></p>\n\n<h2 style=\"text-align:justify\">&nbsp;</h2>\n\n<h2 style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\">三、外貿協會國際貿易課程</span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">外貿協會國際企業人才培訓中心(台北)以及桃、竹、中、南、高等各地區辦事處不定期開設貨款催收管理課程，服務在地廠商。</span></span></p>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">請瀏覽各辦事處官網，或貿協「活動匯」網頁。</span></span></p>\n',	'',	'',	'貿易糾紛,付款及收帳問題,國際貿易,線上諮詢',	NULL,	'2021-06-07',	'2021-06-07 03:25:35'),
(23,	'貿易風險',	'',	'2021-03-19 14:05:47',	4,	1,	NULL,	NULL,	1,	600,	'https://www.eximbank.com.tw/zh-tw/Pages/default.aspx',	'',	'',	'',	'',	'601a5fe190de1.jpg',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、中國輸出入銀行 國外徵信報告之簡介及買主風險規避</span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">請參閱中國輸出入銀行所編著「<a href=\"https://reurl.cc/q8epMp\" target=\"_blank\">國外徵信報告之簡介及買主風險規避</a>」</span></span></p>\n\n<p>&nbsp;</p>\n\n<h2>二、<span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">台灣經貿網「<span style=\"background-color:white\"><a href=\"https://info.taiwantrade.com/index/Fraud_risk\" target=\"_blank\">降低貿易詐欺風險專區</a>」</span></span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">為提高我國廠商警覺，外貿協會</span>「台灣經貿網」特別架設「<span style=\"background-color:white\">降低貿易詐欺風險專區」，請詳細瀏覽相關資料，並提高警覺，杜絕詐騙。</span></span></span></p>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">目前常見的貿易詐騙行為以網路詐騙為主，主要型態分成以下：</span></span></p>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><a href=\"https://info.taiwantrade.com/biznews/%E7%AB%84%E6%94%B9%E5%95%86%E5%8B%99%E9%9B%BB%E5%AD%90%E9%83%B5%E4%BB%B6%E8%A9%90%E9%A8%99%E6%A1%88%E4%BE%8B-1782473.html\" target=\"_blank\">竄改商務電子郵件</a>：以供應商名義通知下訂客戶(銀行帳戶更改)，要求將貨款改匯入(騙徒的)其他帳戶。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><a href=\"https://reurl.cc/v55nWa\" target=\"_blank\">釣魚郵件</a>：騙取受害者的帳號及密碼。過去亦有假冒「台灣經貿網」客服名義進行詐騙。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><a href=\"https://info.taiwantrade.com/index/expo_guide_2\" target=\"_blank\">展覽詐騙手法</a>：邀請參展廠商前往騙徒架設之B2B網站登錄,並誤導廠商簽下<span style=\"background-color:white\">合約，索取巨額款項。</span></span></span></li>\n</ol>\n',	'',	'',	'貿易風險,國際貿易,經貿網,線上諮詢',	NULL,	'2021-03-19',	'2021-03-19 06:05:47'),
(25,	'展覽補助',	'',	'2021-03-19 14:13:50',	5,	1,	NULL,	NULL,	1,	800,	'https://www.ieatpe.org.tw/espo/Index.aspx',	'',	'',	'',	'',	'601a604fa6302.png',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、 經濟部「<a href=\"http://www.ieatpe.org.tw/espo/Index.aspx\" target=\"_blank\">補助公司或商號參加海外國際展覽業務</a>」計畫</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">為協助廠商開拓海外市場，爭取接單機會，並提高我國商品之能見度，貿易局每年編列預算針對個別廠商赴海外參加國際展覽給予場地租金之補助。</span></span></p>\n\n<p style=\"margin-left:40px\">&nbsp;</p>\n\n<p style=\"margin-left:40px\">&nbsp;</p>\n',	'',	'',	'展覽補助,國際展覽,經濟部,線上諮詢',	NULL,	'2021-06-07',	'2021-06-07 03:27:39'),
(26,	'協助廠商布建海外通路',	'',	'2021-02-08 10:53:31',	5,	1,	NULL,	NULL,	1,	700,	'https://www.imdp.org.tw/',	'',	'',	'',	'',	'601a608b2725e.jpg',	'',	'',	'',	'',	NULL,	NULL,	NULL,	NULL,	NULL,	'<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、經濟部國際貿易局「<a href=\"https://www.imdp.org.tw/\" target=\"_blank\">補助業界開發國際市場計畫</a>」</span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">經濟部國際貿易局為協助國內廠商布建海外通路，辦理補助業界開發國際市場計畫，並委託社團法人中華民國管理科學學會執行。</span></span><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">此計畫有別於參展團、拓銷團、買主媒合等傳統推廣活動性質，透過專案補助方式，協助廠商布建海外行銷通路，以推廣臺灣產品及提升我國廠商之出口競爭力。</span></span><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">布建通路態樣包括新設據點（如：分公司、子公司、展示中心、發貨倉庫或其他類似性質之據點）及新增代理商/經銷商等。</span></span></span></p>\n',	'',	'',	'布建海外通路,補助業界開發國際市場計畫,線上諮詢',	NULL,	'2021-02-08',	'2021-02-08 02:53:31'),
(27,	'貿易金融',	'',	'2021-03-19 14:13:38',	5,	1,	NULL,	NULL,	1,	800,	'https://www.eximbank.com.tw/zh-tw/Pages/default.aspx',	'',	'',	'',	'',	'601a60c3d80a1.jpg',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'<p style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">為降低廠商出口資金成本以及貿易風險，經濟部與中國輸出入銀行合作辦理優惠出口貸款、輸出保險及轉融資；並與信保基金合作辦理外銷信用保證。提供廠商優惠貸款利率、保險費率及保證手費，以增加廠商國際競爭力，擴大出口。</span></span></p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、出口貸款</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">除中國輸出入銀行外，目前國內多家銀行均有提供此項業務</span></span></p>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">兆豐銀行</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">第一銀行</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">遠東商銀</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">富邦銀行</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">中國信託銀行</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">合作金庫</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">彰化銀行</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">華南銀行</span></span></li>\n</ul>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">二、<a href=\"https://reurl.cc/XkYRnM\" target=\"_blank\">輸出保險</a></span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">中國輸出入銀行推出多種形態的輸出保險。包括信用狀貿易、託收( D/P &amp; D/A)、記帳(O/A)方式等輸出保險。此外，亦有針對中小企業客戶所推出的安因出口保險，以及全球通帳款保險、海外投資保險、海外工程保險等。</span></span></p>\n\n<p style=\"margin-left:40px; text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">三、<a href=\"https://reurl.cc/Q3kpZ9\" target=\"_blank\">轉融資</a></span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">輸出入銀行為積極鼓勵並拓展我國產品之出口，特開辦轉融資業務，授予國內外金融機構信用額度，轉貸其客戶向我國出口商購買產品，亦即本行透過前述融資方式，提供國外買主優惠之分期付款融資，以激發其購買我國產品之意願，並加強我國產品在國際市場上之競爭力。</span></span></span></p>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">目前輸銀與全球30個國家的銀行，進行轉融資業務的合作。請參閱官網5. 「轉融資銀行」，並直接開啟附件名單</span></span></p>\n',	'',	'',	'貿易金融,出口貸款',	NULL,	'2021-06-07',	'2021-06-07 03:27:08'),
(28,	'其他各項補助措施',	'',	'2021-03-19 14:18:40',	5,	1,	NULL,	NULL,	1,	500,	'https://assist.nat.gov.tw/wSite/np?ctNode=170&mp=2',	'',	'',	'',	'',	'601a639b16c88.png',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、<a href=\"https://reurl.cc/LdzkXX\" target=\"_blank\">製造業振興紓困大補帖</a></span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">為因應「COVID-19(武漢肺炎)疫情對製造業的衝擊，經濟部提出多元紓困措施，以最快速度協助製造業走出困境。</span></span></p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">二、</span>「<a href=\"https://assist.nat.gov.tw/wSite/qp?ctNode=150&amp;mp=2&amp;xslPage=qps\" target=\"_blank\">產業輔導1999</a>」</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-family:Arial,Helvetica,sans-serif; font-size:20px\">為協助產業升級轉型，政府持續推動「5+2產業創新計畫」，引導產業由過去「效率驅動」轉為「創新驅動」思維，協助台灣產業持續創新轉型，並在既有基礎上，打造「六大核心戰略產業」，讓台灣成為未來全球經濟的關鍵力量。經濟部依據前述產業政策，每年編列預算，推動各項專案計畫，提供產業輔導、補助及培訓等服務協助產業加速升級轉型。</span></p>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">為使企業快速瞭解政府資源，將功能別計畫以產、銷、人、發、財等企業發展所需資源之方式歸類：</span></span></p>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">生產類(經營管理、資訊應用、工安環保、節能減碳)</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">行銷類(市場行銷、品牌發展)</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">人才類(人才培訓、人才媒合)</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">研發類(研發創新、創意設計、智慧財產)</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">財務類(貸款協助、投資協助)</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\">其他類(產業育成、產業服務、標準制度)</span></span></li>\n</ul>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">三、台灣經貿網「<a href=\"https://info.taiwantrade.com/infolink?category=6045\" target=\"_blank\">最新補助資訊</a>」</span></span></h2>\n',	'',	'',	'各項補助措施,產業競爭力發展中心',	NULL,	'2021-06-07',	'2021-06-07 03:28:37'),
(29,	'貿協官網及ONE TAITRA服務手冊',	'',	'2021-03-19 14:19:52',	6,	1,	NULL,	NULL,	1,	900,	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、貿協官網及ONE TAITRA服務手冊</span></span></h2>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><a href=\"https://www.taitra.org.tw/default.aspx\" target=\"_blank\">貿協官網廠商服務單一入口</a></span></span></li>\n</ol>\n\n<p style=\"margin-left:80px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">為便利廠商更便捷地取用貿易資訊、善用各類拓銷服務資源，外貿協會綜整豐富多樣化的服務，分門別類展現於這個單一入口網頁上。</span></span></p>\n\n<p style=\"margin-left:80px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">貿協舉辦的活動、全球展覽、全球商情、貿易數據、諮詢服務、台灣精品、拓銷團、研討會、洽談會、培訓課程，以及會展場地等等都能在這裡輕鬆查到。廠商只要註冊成為貿協會員，使用單一帳號登入便可直接使用各類貿協拓銷服務！</span></span></p>\n\n<ol start=\"2\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><a href=\"http://reurl.cc/4m7xzX\" target=\"_blank\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">「貿協服務手冊」ONE TAITRA</span></span></a></li>\n</ol>\n\n<p style=\"margin-left:80px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">「貿協服務手冊」專文介紹各項服務及特色，並提供網址、服務承辦單位及駐外單位聯絡資訊。各專頁皆提供相關網址至各項服務，手冊亦可下載至手機方便隨時查閱。</span></span></p>\n',	'',	'',	'貿協官網,ONE TAITRA,服務手冊',	NULL,	'2021-03-19',	'2021-03-19 06:19:52'),
(30,	'駐外單位協助廠商',	'',	'2021-02-08 11:17:43',	6,	1,	NULL,	NULL,	1,	800,	'https://info.taiwantrade.com/subject/obc',	'',	'',	'',	'',	'601a641c9e386.jpg',	'',	'',	'',	'',	NULL,	NULL,	NULL,	NULL,	NULL,	'<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、可向<a href=\"https://www.taitra.org.tw/iframe.aspx?n=10\" target=\"_blank\">貿協駐外單位</a>索取駐地潛在買主名單</span></span></h2>\n\n<ul>\n	<li style=\"margin-left: 40px;\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">外貿協會目前在全球63個城市設有行銷據點。我國廠商可以電子郵件(中、英文均可)向駐外單位提出明確需求，表明欲索取駐地目標潛在買主資料。除了當地連假或外館有重大活動舉辦較忙碌等因素，通常廠商一週左右可接獲駐外單位回函，並附上潛在買主名單。</span></span></li>\n	<li style=\"margin-left: 40px;\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">建議廠商可逕自以電子郵件或電話洽貿協駐外單位，詢問相關拓銷資訊、市場現況；若有機會到當地市場考察，亦可親自至辦事處拜訪。</span></span></li>\n</ul>\n\n<p style=\"margin-left:59px\">&nbsp;</p>\n\n<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">二、<a href=\"https://info.taiwantrade.com/subject/obc\" target=\"_blank\">海外商務中心</a></span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">另歡迎廠商利用貿協辦事處之辦公設施作為出差期間之商務中心，相關資訊請參考「海外商務中心」</span></span></p>\n',	'',	'',	'駐外單位,海外商務中心,外貿協會,線上諮詢',	NULL,	'2021-02-08',	'2021-02-08 03:17:43'),
(31,	'培訓國際行銷人才',	'',	'2021-02-08 10:55:46',	6,	1,	NULL,	NULL,	1,	700,	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	NULL,	NULL,	NULL,	NULL,	NULL,	'<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、<a href=\"https://www.iti.org.tw/\" target=\"_blank\">培訓中心課程</a>&nbsp;</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">因應業界對經貿實務人才之熱切需求，培訓中心（ITI）提供多元化課程，由教學經驗豐富的專業外籍師資及來自業界的講師，提供扎實的職前及在職訓練，包含外語、行銷、經貿及會展課程專業訓練。另配合產業需求開辦產業行銷專班、依照企業需求量身訂作培訓課程，以及針對企業高階主管推出實戰課程，增進國際視野及國際鏈結，是企業及個人進修的最佳選擇。</span></span></p>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">專業訓練：辦理「國際企業經營班」、「國際企業特訓班」，透過經貿實務及外語長期密集訓練，培訓全方位外貿菁英人才。</span></span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">在職訓練：針對在職人士不同需求，提供「企業高階主管實戰班」、「國際企業在職班」、「新南向人才儲備專班」、「東部國際人才特訓班」以及各類短期經貿專題班、特殊外語班、產業行銷專班等多樣進修選擇。</span></span></span></li>\n</ol>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">二、貿協國內各辦事處「工商講座」</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">貿協各地區辦事處「活動訊息」及課程資訊如下</span></span></p>\n\n<ul style=\"margin-left:80px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><a href=\"https://taoyuan.taiwantrade.com/note/detail?id=4549)\" target=\"_blank\">桃園辦事處</a></span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><a href=\"https://hsinchu.taiwantrade.com/event/list\" target=\"_blank\">新竹辦事處</a></span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><a href=\"https://taichung.taiwantrade.com/event/list\" target=\"_blank\">台中辦事處</a></span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><a href=\"https://tainan.taiwantrade.com/event/list\" target=\"_blank\">台南辦事處</a></span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><a href=\"https://events.taiwantrade.com/KH20210000\" target=\"_blank\">高雄辦事處</a></span></span></li>\n</ul>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">另可參閱貿協「活動匯」網頁，獲取各地區辦事處最新開課訊息。</span></span></p>\n',	'',	'',	'培訓國際行銷人才,貿協辦事處,培訓中心',	NULL,	'2021-02-08',	'2021-02-08 02:55:46'),
(32,	'企業攬才',	'',	'2021-02-08 10:56:26',	6,	1,	NULL,	NULL,	1,	600,	'https://www.contacttaiwan.tw/main/index.aspx',	'https://www.iti.org.tw/index.php',	'',	'',	'',	'601a64d39a5a9.png',	'601a64f35c886.png',	'',	'',	'',	NULL,	NULL,	NULL,	NULL,	NULL,	'<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、<a href=\"https://www.contacttaiwan.tw/main/index.aspx\" target=\"_blank\">Contact TAIWAN</a> 全球攬才方案</span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">為協助國內企業延攬海外人才，貿協執行經濟部攬才計畫，特別建置國家級單一攬才入口網站── Contact TAIWAN。結合線上24 小時不打烊的企業與人才媒合服務及線下的國內外攬才活動，協助貴公司延攬關鍵人才！</span></span><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Contact TAIWAN 提供逾1萬5,000 位人才資料庫，可直接線上邀約人才進行面試，系統亦會推薦潛在人才名單，提高企業與人才的媒合率，可24 小時不間斷地尋找優秀人才。</span></span></p>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Contact TAIWAN每年畢業季前在臺舉辦僑外生在臺就業媒合會，協助廠商找到精通目標市場文化及語言人才的捷徑，並可依業務需求安排人才於國內或海外任職。同時，</span></span><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">Contact TAIWAN 每年亦分別前往歐、美、日、東南亞及印度等地，協助臺灣企業於海外聯合徵才，匯聚人才以提高媒合成功率。</span></span></p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">二、<a href=\"https://www.iti.org.tw/?cid=25&amp;go=company\" target=\"_blank\">貿協培訓中心</a>(ITI)企業徵才服務介紹</span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">企業人才媒合活動是以一種全方位服務的概念，提供下列管道讓企業前來徵才。包含：</span></span></p>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:80px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">人才媒合會：</span></span></span></li>\n</ol>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">係為半日型面談展示合一活動，廣邀各家企業同時於現場進行產品展示及一對一面談，可於最短時間與多位學員進行第一次接觸。再從中邀請合適學員至公司進行二次面談或直接聘雇</span></span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">國企班於每年3月於新竹、台中、高雄辦理。</span></span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">特訓班則於每年6月及12月於台北辦理。</span></span></span></li>\n</ul>\n\n<ol start=\"2\" style=\"list-style-type:decimal; margin-left:80px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">企業徵才會：企業個別到校辦理徵才說明會，可完整而深入的介紹公司文化及職缺內容，ITI可依企業需求進行客製化服務。</span></span></span></li>\n</ol>\n',	'',	'',	'企業攬才,Contact TAIWAN,貿協培訓中心,ITI',	NULL,	'2021-02-08',	'2021-02-08 02:56:26'),
(33,	'國際展覽訊息',	'',	'2021-03-19 11:08:25',	2,	0,	NULL,	NULL,	1,	700,	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	NULL,	'2021-03-19',	'2021-03-19 03:08:25'),
(34,	'台灣國際專業展(台北&高雄)',	'',	'2021-03-19 11:10:52',	33,	1,	NULL,	NULL,	1,	900,	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、台灣國際專業展</span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">雖受電子商務及網路行銷的風潮影響，參加展覽仍為促銷產品最主要方式，惟赴國外參展，除參展費用(場租及攤位裝潢)高，再加上參展人員機票、旅館住宿等差旅費，以及展品運送、聘雇翻譯人員等費用，赴海外參展的經濟效益，確實應仔細評估。</span></span><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">相對之下，參加台灣的國際專業展，應能以合理、經濟的參展成本，達到最佳促銷效果。</span></span></p>\n\n<ul style=\"margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">外貿協會在臺辦理近40 項國際專業展，每年吸引超過1萬家國內外廠商參展，以及逾8萬名國外買主來臺參觀採購。</span></span><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">外貿協會台灣國際專業展讓您在臺參展就能與國際接軌拓銷全球! </span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">有關台灣國際專業展各展檔期，請參閱「<a href=\"https://www.taiwantradeshows.com.tw/zh_TW/index.html\" target=\"_blank\">台灣國際專業展整合式線上服務</a>」官網，並點選「展覽檔期」。</span></span></li>\n</ul>\n',	'',	'',	'國際專業展,展覽,台北,高雄,線上諮詢',	NULL,	'2021-03-19',	'2021-03-19 03:10:52'),
(35,	'海外專業展覽',	'',	'2021-03-19 11:13:10',	33,	1,	NULL,	NULL,	1,	800,	'https://www.taiwanexpoasean.com/index.html',	'https://www.ieatpe.org.tw/espo/Index.aspx',	'',	'',	'',	'601a3f0cbb6b3.jpg',	'601a391108701.png',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、外貿協會海外展覽</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">貿協除了在馬來西亞、印尼、泰國、越南及印度等新南向國家，辦理「台灣形象展 」，亦積極組團至美國、德國、日本、中東(杜拜)參加重要展覽。</span></span></p>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">台灣形象展相關訊息請參考貿協「<a href=\"https://www.taiwanexpoasean.com/index.html\" target=\"_blank\">新南向台灣形象展</a>」(TAIWAN EXPO)官網。</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">貿協組團參加海外展覽訊息，請參閱「<a href=\"https://events.taiwantrade.com/\" target=\"_blank\">活動匯</a>」網站</span></span></li>\n</ol>\n\n<h2 style=\"margin-left:90px\">&nbsp;</h2>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">二、公協會組團赴外參展</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">各產業公協會，以及台北市進出口公會，亦積極組團赴海外參加該產業的重要國際展覽。</span></span></p>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">請先確認貴公司的產業(產品)性質，應歸屬於哪個產業公會。可參考工業總會所架設「工業團體服務網」的「<a href=\"http://www.industry.org.tw/Company/Company.asp\" target=\"_blank\">工業團體全名錄</a>」，依產業歸類搜尋。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">通常各產業公會均有官網，網頁上會公布其近期組團參國外專業展覽訊息。值得注意的是，公協會所參加展覽多為該項產業人氣指數較高的專業展覽。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">另建議可積極加入公會組織，不僅建立產業界人脈，也可獲取該產業最新動態及法規變動等相關訊息。</span></span></li>\n</ol>\n\n<h2 style=\"margin-left:85px; text-align:justify\">&nbsp;</h2>\n\n<h2><span style=\"font-size:20px\">三、<span style=\"font-family:Arial,Helvetica,sans-serif\">經濟部補助廠商赴外參展</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">經濟部專案補助我國廠商赴海外參展，請參考<span style=\"background-color:white\"><span style=\"color:black\">「<a href=\"https://www.ieatpe.org.tw/espo/Index.aspx\" target=\"_blank\">經濟部補助公司或商號參展辦公室</a>」官網。</span></span></span></span></p>\n\n<p style=\"margin-left:33px; text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">四、<a href=\"https://tsp.taiwantrade.com/exhibition.aspx?n=55&amp;sms=9041\" target=\"_blank\">海外參展決策輔助平台</a></span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">本平台從廠商參展需求出發，規劃互動式的網頁，可快速瞭解8,000個專業展覽基本資訊及近年 趨勢變化。平台更進一步提供展覽比較、展覽收藏、展覽評論、自動化展覽推薦等進階功能，協助廠商從多面向進行參展評估。 </span></span></p>\n\n<ul style=\"margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">本份功能介紹包含四個重點內容：</span></span></li>\n</ul>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:80px\">\n	<li style=\"text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif; font-size:20px\">智慧展覽查詢功能 </span><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">：貿協研發優化演算法，讓您以展覽/產品關鍵字、 國家、年份及產業等條件精準篩選展覽，視覺化 呈現相關展覽分佈、列表及排名。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">展覽資訊快速蒐集 ：點擊展覽名稱後，即可更進一步了解各展詳細資訊，包含基本資訊、參展人數、參展商數、展覽 面積的趨勢變化。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">個人化功能設計 ：互動式網站設計讓貿協會員登入後可使用個人化 展覽收藏、展覽比較及展覽評論等功能，以滿足 展覽資訊蒐集需求</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">自動化展覽推薦</span></span>：<span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">根據台灣廠商的參展行為，計算展覽間關聯 性，作展覽自動化推薦，提供您更多的參展選擇。</span></span></li>\n</ol>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<p><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\">五、貿協國內辦事處</span></span></p>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">另外貿協會國際企業人才培訓中心(台北)以及桃、竹、中、南、高等各地區辦事處，亦不定期開設展覽行銷課程，服務在地廠商。請瀏覽各辦事處官網，或電洽相關辦事處詢問。</span></span></p>\n\n<ul style=\"margin-left:40px\">\n	<li><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\"><a href=\"https://www.iti.org.tw/\" target=\"_blank\">國際企業人才培訓中心</a></span></span></li>\n	<li><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\"><a href=\"https://hsinchu.taiwantrade.com/home\" target=\"_blank\">外貿協會新竹辦事處</a></span></span></li>\n	<li><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\"><a href=\"https://taoyuan.taiwantrade.com/home\" target=\"_blank\">外貿協會桃園辦事處</a></span></span></li>\n	<li><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\"><a href=\"https://taichung.taiwantrade.com/home\" target=\"_blank\">外貿協會台中辦事處</a></span></span></li>\n	<li><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\"><a href=\"https://tainan.taiwantrade.com/home\" target=\"_blank\">外貿協會台南辦事處</a></span></span></li>\n	<li><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\"><a href=\"https://kh.taiwantrade.com/home\" target=\"_blank\">外貿協會高雄辦事處</a></span></span></li>\n</ul>\n',	'',	'',	'海外專業展覽,台灣形象展,',	NULL,	'2021-03-19',	'2021-03-19 03:13:10'),
(36,	'展會之外的其他拓銷途徑',	'',	'2021-03-19 11:13:51',	33,	1,	NULL,	NULL,	1,	700,	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\">一、線上展</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">線上展 (台灣國際專業展『<a href=\"https://reurl.cc/8nm0Ao\" target=\"_blank\">整合式線上服務</a>』一覽表)</span></span></p>\n\n<ul style=\"margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">2020年新冠肺炎疫情肆虐全球，考量參展廠商及參觀者健康安全，外貿協會辦理之台灣國際專業展陸續宣布延期或停辦。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">因應疫情期間實體展覽無法如期舉辦，為提供參展商及買主最新的台灣國際專業展資訊，持續服務參展商之拓銷需求，以及國際買主之採購需求，貿協針對延期辦理的國際專業展，推出一系列線上式整合服務，包含2D/VR線上展、線上採購洽談會、線上專業展系列報導及線上新產品發表會。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">廠商可前往網站瀏覽，並歡迎報名共同參與。</span></span></li>\n</ul>\n',	'',	'',	'線上展,雲端虛擬展示,展覽,線上諮詢',	NULL,	'2021-06-07',	'2021-06-07 03:10:59'),
(37,	'品牌推廣',	'',	'2021-03-19 11:16:41',	2,	1,	NULL,	NULL,	1,	600,	'https://www.taiwanexcellence.org/tw',	'https://www.branding-taiwan.tw/',	'',	'',	'',	'601a3f797a126.jpg',	'601a400840e49.png',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、外貿協會「<a href=\"https://www.taiwanexcellence.org/tw\" target=\"_blank\">台灣精品</a>」</span></span></h2>\n\n<p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">參加外貿協會「台灣精品」選拔，「台灣精品」是國家評選最具創新價值的優良產品</span></span></p>\n\n<ul style=\"margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">台灣精品獎選拔：台灣精品獎依據「研發」、「設計」、「品質」、「行銷」及「臺灣產製」五項標準，由百餘位專家評審評選而出。每年約3月開放報名，廠商可至台灣精品官網或訂閱台灣精品LINE@，隨時掌握台灣精品最新情報。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">獲獎後擁有更多行銷資源：獲獎產品有機會參加臺灣產業形象廣宣計畫在各目標市場的廣宣活動，例如在美國最大消費性電子展（CES）台灣精品館展出、擔任台灣精品產品發表會發表廠商、接受媒體專訪與買主洽談，或是進駐台灣精品展售店或電商平台等，多元的行銷方式有助於目標市場消費者更加認識您的品牌與產品。</span></span></li>\n</ul>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">二、外貿協會品牌推廣課程</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">另國際企業人才培訓中心(台北)以及桃、竹、中、南、高等各地區辦事處亦不定期開設品牌推廣課程，服務在地廠商。例如：貿協高雄辦事處2021年即規畫開設下列品牌推廣課程：</span></span></p>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\">後疫情時代下經營國際行銷與品牌實務解析(7/9)</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\">專業性產品技術品牌-利基市場技術型行銷實務班(7/28)</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\">B2B企業品牌行銷即戰力-品牌升級的業務開拓(8/26)</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">請瀏覽各辦事處官網，或貿協「<a href=\"https://events.taiwantrade.com/KH20210000\" target=\"_blank\">活動匯</a>」網頁</span></span></li>\n</ul>\n\n<h2 style=\"text-align:justify\">&nbsp;</h2>\n\n<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">三、「<a href=\"https://www.branding-taiwan.tw/\" target=\"_blank\">台灣品牌躍飛計畫</a>」專案(Branding Taiwan)</span></span></h2>\n\n<ul>\n	<li style=\"text-align: justify;\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">此為經濟部工業局計畫專案，委託台灣經濟研究院執行</span></span></span></li>\n	<li style=\"text-align: justify;\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">整合國內外品牌顧問公司與法人輔導團隊，透過諮詢診斷與企業客製化輔導服務，協助國內廠商強化品牌管理、通路拓展、品牌智財等多元核心能量</span></span></li>\n</ul>\n',	'',	'',	'品牌推廣,台灣精品,線上諮詢',	NULL,	'2021-06-07',	'2021-06-07 03:13:55'),
(38,	'爭取國外政府標案',	'',	'2021-03-19 11:17:27',	2,	1,	NULL,	NULL,	1,	500,	'https://gpa.taiwantrade.com.tw/zh/home',	'',	'',	'',	'',	'601a406f90770.jpg',	'',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2>一、<a href=\"https://gpa.taiwantrade.com.tw/zh/home\" target=\"_blank\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">全球政府採購商機網</span></span></a></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">在我國於2009年6月加入政府採購協定（GPA）後，臺灣與其他簽署會員國相互開放政府採購市場，為協助我國廠商爭取全球政府採購商機，經濟部國際貿易局旋即委託外貿協會執行「爭取全球政府採購商機專案」，簡稱GP專案。</span></span></p>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">有關全球各國的GPA採購商機，請參閱本網站之「<a href=\"https://gpa.taiwantrade.com.tw/zh/projects/list\" target=\"_blank\">國際標案</a>」專區</span></span></li>\n</ol>\n\n<p style=\"margin-left:80px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">本專案服務範圍不以產業、或市場為限定，凡我業者欲爭取來自國外政府單位、公共服務事業、大型業主或國際金融機構(如亞銀、歐銀、世銀)之商機者，皆為本專案服務之對象，亦不拘任何採購型式(或標案、或下包、或PPP&hellip;)。但由於資源有限，若本專案主動出擊之活動，自2018至2020年三年期程，將鎖定在「新南向」、「歐銀受援國市場」，在產業上則聚焦在「智慧城市」、「綠能」產業。</span></span></p>\n\n<ol start=\"2\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">另經濟部提供備案資源，鼓勵我國業者直接投入外國政府標案，或成為外國大型標案得標商供應商。請詳閱網頁說明，並逕洽承辦單位：<a href=\"https://gpa.taiwantrade.com.tw/zh/pages/about/project-mission\" target=\"_blank\">外貿協會行銷專案處專案組</a>。</span></span></li>\n</ol>\n',	'',	'',	'國外政府標案,線上諮詢',	NULL,	'2021-03-19',	'2021-03-19 03:17:27'),
(39,	'物流及倉儲 ',	'',	'2021-03-19 11:19:49',	2,	1,	NULL,	NULL,	1,	400,	'http://www.talm.org.tw/',	'http://www.tilagls.org.tw/',	'',	'',	'',	'601a452bb8751.png',	'601a45e340dfa.png',	'',	'',	'',	'',	'',	'',	'',	'',	'<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、<span style=\"background-color:white\">美國及西歐主要國家保稅倉庫名單</span></span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">參閱「<a href=\"http://www.trademag.org.tw/page/newsid1/?id=746517&amp;iz=6\" target=\"_blank\">美國及西歐主要國家保稅倉庫名單</a>」(2019年4月資料)，為協助我國廠商提供美國及歐洲國家客戶快速到貨等服務，外貿協會透過其美、歐駐外單位取得美國（紐約、芝加哥、舊金山、洛杉磯、邁阿密）、德國（杜塞道夫、慕尼黑）、英國、法國、荷蘭、義大利、西班牙及土耳其等8國13地保稅倉庫業者名單(請下載附件)，供我國廠商參考運用。</span></span></span></p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">二、外貿協會 物流、報關推廣課程</span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">另外貿協會國際企業人才培訓中心(台北)以及桃、竹、中、南、高等各地區辦事處亦不定期開設物流、報關等主題推廣課程，服務在地廠商。例如：貿協<a href=\"https://hsinchu.taiwantrade.com/event/list\" target=\"_blank\">新竹辦事處</a>2021年下半年即規畫開設下列課程：</span></span></p>\n\n<ul style=\"margin-left:40px\">\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一次搞定港口通關作業 (7/2)</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">進出口通關流程及成本分析實戰班(7/23)</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">「進出口通關流程」研習班(8/17)</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">國際貿易與進出口通關實務(10/19)</span></span></li>\n</ul>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">請瀏覽各辦事處官網，或貿協「活動匯」網頁。</span></span></p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">三、<a href=\"https://like.logistics.org.tw/Home/Index\" target=\"_blank\">智慧商業暨物流/知識服務網</a></span></span></span></h2>\n\n<p style=\"margin-left:48px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">為經濟部商業司主辦、工研院服科中心執行的專案計畫。推動目標是為智慧商業及物流產業建立良好的知識分享環境與互動平台，提供智慧商業及物流產業資訊服務、知識基礎服務以及技術服務，促進產業資訊、知識的流通與應用，讓使用者可於該服務中心達到 One Stop Sourcing 之效。</span></span></p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">四、<a href=\"http://www.talm.org.tw/index.php?units=talm\" target=\"_blank\">中華民國物流協會</a></span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">王清風理事長為國內知名相關領域之專家</span></span></p>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">五、<a href=\"http://www.tilagls.org.tw/\" target=\"_blank\">台灣國際物流暨供應鏈協會</a></span></span></h2>\n\n<p style=\"margin-left:40px\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">秦玉玲理事長為國內知名相關領域之專家</span></span></p>\n',	'',	'',	'物流,倉儲,線上諮詢',	NULL,	'2021-06-07',	'2021-06-07 03:15:57'),
(40,	'市場商情',	'',	'2021-03-19 10:43:12',	1,	1,	NULL,	NULL,	1,	900,	'https://www.taitraesource.com/',	'https://www.trademag.org.tw/',	'',	'',	'',	'601a0a7418b05.jpg',	'601a0ab16b343.png',	'',	'',	'',	'',	'',	'',	'',	'',	'<h3 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">有關各國商情新訊，建議以下貿協服務：</span></span></h3>\n\n<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">一、海外貿易資訊</span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">電腦版：<a href=\"https://www.taitraesource.com/\" target=\"_blank\">貿協全球資訊網</a></span></span></p>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">手機版：《全球經貿e 指通》App:&nbsp;&nbsp;<a href=\"https://play.google.com/store/apps/details?id=tw.org.taitra.taitrayear&amp;hl=zh_TW\" target=\"_blank\">Android版</a> / <a href=\"https://apps.apple.com/mo/app/%E5%85%A8%E7%90%83%E7%B6%93%E8%B2%BFe%E6%8C%87%E9%80%9A/id1022748751\" target=\"_blank\">iOS版</a></span></span></p>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">該資料庫前身為外貿協會「經貿年報」，資料每年均更新，共列計全球173 個國家地區「國家總體資料」，包括該國過去一年經濟回顧與展望、主要產業概況、市場環境分析及拓銷建議等單元。業者可以隨時隨地查閱，時時刻刻掌握市場。</span></span></li>\n	<li><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">針對所欲查詢之特定市場資訊，在首頁上端設定「洲別」及「國家」後，按Return。畫面更新後，再自左側「國家總體資料」各欄，選取所欲查詢資料。</span></span></li>\n</ol>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">二、「台灣經貿網」<a href=\"https://info.taiwantrade.com/biznews/#menu=11607\" target=\"_blank\">商情電子報</a></span></span></h2>\n\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">蒐集經濟部及外貿協會派駐全球100多國經貿人員所撰寫的最新海外市場即時商情。</span></span></p>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">在新興產業及全球熱點部分，商情主要包含下列主題：</span></span></li>\n</ol>\n\n<ul style=\"list-style-type:disc; margin-left:80px\">\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\">綠色能源</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\">新創科技</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\">人工智慧物聯網(AIoT) </span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\">法規資訊</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\">市調報告</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\">瞄準電動車市場</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\">自由貿易區</span></span></li>\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\">智慧機械</span></span></li>\n</ul>\n\n<ol start=\"2\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">另有涵括生技醫療、機械、數位、車輛、美妝、資通訊等『焦點產業』單元</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">在地區商情部分，有涵括全球六大洲的『全球經貿商情』單元</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">除前述分類之全球產業及地區即時商情，亦可以在『商情快蒐』單元，以產業、地區、(商情)類別或關鍵字搜尋商情。</span></span></li>\n</ol>\n\n<p style=\"text-align:justify\">&nbsp;</p>\n\n<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">三、經濟部國際貿易局「<a href=\"https://reurl.cc/832ogy\" target=\"_blank\">全球商情資訊</a>」</span></span></h2>\n\n<p style=\"margin-left:59px; text-align:justify\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"font-size:20px\">經濟部駐外單位為利業者即時掌握商情，廣泛蒐集相關資訊供業者參考。</span></span></p>\n\n<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">四、<a href=\"https://www.trademag.org.tw/\" target=\"_blank\">經貿透視雙周刊資訊網</a></span></span></h2>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">《經貿透視》是一本專業經貿中文雜誌，透過記者深入採訪，以及由經濟部與外貿協會100 多個駐外單位，蒐集全球商情編輯而成，希望提供廠商最新的產業趨勢與市場脈動，進而獲取商機。該雜誌累積各期的地區、產業商情，形成內容豐富的資料庫，並可以關鍵字搜尋相關商情。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">該資訊網並非免費服務，目前最基本的付費會員(僅限線上閱讀)費用為每年新台幣1,500元，續訂戶更可享每年1,000元優惠。<span style=\"background-color:white\">於訂閱期間內：</span></span></span></li>\n</ol>\n\n<ul style=\"margin-left:80px\">\n	<li style=\"text-align:justify\" value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\">可檢索「經貿透視雙周刊」全文資料及「經貿透視知識庫」文章(含括所有歷史商情資料)，。</span></span></span></li>\n	<li value=\"50\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\"><span style=\"background-color:white\"><span style=\"background-color:white\">另加贈免費下載貿協出版之市調報告</span> <span style=\"background-color:white\">總共28本!&nbsp;(內含18國 + 10個產業)</span></span></span></span></li>\n</ul>\n\n<p style=\"margin-left:26px; text-align:justify\">&nbsp;</p>\n\n<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">五、外貿協會「全球政府採購商機網」亦有『<a href=\"https://gpa.taiwantrade.com.tw/zh/home\" target=\"_blank\">全球商情</a>』單元</span></span></h2>\n\n<p>&nbsp;</p>\n\n<h2 style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">六、國際行銷諮詢加值型服務 IMAC Plus </span></span></h2>\n\n<ol start=\"1\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">由外貿協會「國際行銷諮詢中心」顧問，提供進階諮詢服務。</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">從釐清廠商需求、分析產品適銷性，剖析廠商拓銷障礙、問題點後，再提供適切拓銷策略報告，內容包含：</span></span></li>\n</ol>\n\n<ul style=\"list-style-type:disc; margin-left:80px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">市場資訊</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">主要競爭對手</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">適銷通路訪談</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">關稅及非關稅障礙</span></span></li>\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">產品認證及當地法規</span></span></li>\n</ul>\n\n<ol start=\"3\" style=\"list-style-type:decimal; margin-left:40px\">\n	<li style=\"text-align:justify\"><span style=\"font-size:20px\"><span style=\"font-family:Arial,Helvetica,sans-serif\">對本項服務有興趣者，歡迎至貿協「國際行銷諮詢中心」官網報名，或洽承辦單位：國際行銷諮詢中心/諮詢服務組，&nbsp;&nbsp;&nbsp; 電話：02-27255200，分機1223 &amp; 1225。Email: exportadv@taitra.org.tw</span></span></li>\n</ol>\n',	'',	'',	'市場商情,台灣經貿網,外貿協會,線上諮詢',	NULL,	'2021-06-07',	'2021-06-07 05:45:34'),
