(17,	'【由衷感謝】日本政府及人民暖心捐贈臺灣124萬劑疫苗!',	'',	'2021-06-06 00:00:00',	1,	1,	1,	0,	'',	NULL,	'60bc54f440b7f.jpg',	'<p><span style=\"font-family:Comic Sans MS,cursive\"><span style=\"color:#2980b9\"><span style=\"font-size:14px\"><strong>日本是台灣真誠的好朋友，發生天然災害的時候，總是互相幫忙互相溫暖的支持對方。<br />\n這次遇到COVID-19大流行，在台灣疫苗不足遇到困境的時候，日本立即伸出援手，無償提供了124萬劑的疫苗。<br />\n由衷感謝日本的支援，對於日本政府及人民友好善意沒齒難忘。我們由衷感謝日本！！</strong><br />\n<br />\n<img alt=\"\" src=\"/pic/images/%E5%8F%B0%E6%97%A5%E5%8F%8B%E5%A5%BD_5-01.jpg\" style=\"height:800px; width:800px\" /></span></span></span></p>\n',	NULL,	'台日友好 疫苗 新冠肺炎 Japan',	'台日友好 疫苗 新冠肺炎 Japan',	'台日友好 疫苗 新冠肺炎 Japan',	NULL,	'2021-06-06',	'2021-06-06 04:54:15'),
