(5,	'【線上講座會後分享】諮詢服務實戰篇- 物流x電商 『疫』起挖商機',	'線上直播影片精彩回顧',	'2020-06-05 00:00:00',	1,	1,	1,	1,	'',	NULL,	'600e5581428e3.png',	'<h3><strong><img alt=\"enlightened\" src=\"https://exportadv.chun-mu.com/admin/ckeditor/plugins/smiley/images/lightbulb.png\" style=\"height:23px; width:23px\" title=\"enlightened\" />線上直播影片精彩回顧:&nbsp;<a href=\"https://lihi1.cc/eJ0qN\">https://lihi1.cc/eJ0qN&nbsp;</a></strong><br />\n&nbsp;</h3>\n\n<p dir=\"ltr\"><strong>主題1:&nbsp;藉由商業模式九宮格( Business Model Canvas )，解析智慧物流在科技領域中的應用趨勢。</strong></p>\n\n<p dir=\"ltr\"><strong>主講者: 台灣國際物流暨供應鏈協會秦玉玲理事長</strong></p>\n\n<p dir=\"ltr\">&nbsp;➜&nbsp;<strong>簡報檔案下載:&nbsp;</strong><a href=\"https://lihi1.cc/8nZOq\"><strong>https://lihi1.cc/8nZOq&nbsp;</strong></a><br />\n&nbsp;</p>\n\n<p dir=\"ltr\">&nbsp;</p>\n\n<p dir=\"ltr\"><strong>主題2:&nbsp;</strong><strong>挾著電商國寶頭銜，與實戰經驗累積，詮釋知識型電商經營如何系統化導入成功案例</strong><strong>。</strong></p>\n\n<p dir=\"ltr\"><strong>主講者: TeSA台灣電子商務創業聯誼會陳宏欣秘書長</strong></p>\n\n<p dir=\"ltr\">➜&nbsp;<strong>簡報檔案下載:&nbsp;<a href=\"https://lihi1.cc/0pEPI\">https://lihi1.cc/0pEPI&nbsp;</a></strong></p>\n',	NULL,	'',	'',	'',	NULL,	'2021-01-20',	'2021-01-25 05:22:16'),
