INSERT INTO `page` (`id`, `title`, `subtitle`, `description`, `Public_Date`, `type`, `contenttype`, `display`, `sort`, `url`, `filedata`, `pic`, `content`, `attach`, `MetaTitle`, `MetaDesc`, `MetaKeywords`, `Last_UserId`, `init_time`, `Last_time`) VALUES
(1,	'免費諮詢介紹',	'',	'',	'2021-02-22 04:23:06',	1,	1,	1,	1,	NULL,	NULL,	'',	'<div class=\"free_wrap\">\n<div class=\"clean free_title\">\n<div class=\"fr_ft\">01.「國際行銷諮詢中心」簡介</div>\n\n<div class=\"ft_ic\"><img alt=\"\" src=\"/images/down.svg\" /></div>\n</div>\n\n<div class=\"free_qa_box\">\n<div class=\"fe_font\">「國際行銷諮詢中心」為外貿協會為執行經濟部國際貿易局委辦「中小企業國際行銷成長茁壯方案」而設立的單位，主要目的為連結政府資源，協助具國際競爭力的創新產業或中小企業行銷海外市場。該中心由本會曾派駐海外、具備國際市場豐富經驗的地區專家組成，化身為中小企業國際行銷的專屬顧問，提供客製化、一站式的專業諮詢服務，同時引導業者善用政府輔導資源，強化企業經營體質，提昇國際競爭力。</div>\n<!-- <div class=\"fe_tittle\">想拓展海外市場又不知從何開始?在地人脈? <br>市場在哪? 買主在哪?</div>\n                  <div class=\"fe_font\">\n                     提供中小企業陪伴式國際行銷諮詢服務<br>\n                     一站式連結經濟部各單位輔導資源\n                  </div> --></div>\n\n<div class=\"graybg_font\">善用政府輔導資源、強化企業經營體質、快速拓展海外市場、提升國際競爭力</div>\n\n<div class=\"goto_btn\"><a href=\"https://events.taiwantrade.com/exportadv\" target=\"_blank\">立刻報名免費諮詢</a></div>\n</div>\n\n<div class=\"free_wrap\">\n<div class=\"clean free_title\">\n<div class=\"fr_ft\">02.何謂國際行銷諮詢服務?</div>\n\n<div class=\"ft_ic\"><img alt=\"\" src=\"/images/down.svg\" /></div>\n</div>\n\n<div class=\"free_qa_box\">\n<div class=\"fe_tittle\">中小企業國際行銷成長茁壯方案</div>\n</div>\n\n<ul>\n	<li>由貿協曾派駐海外、具海外市場推廣經驗的顧問提供諮詢。</li>\n	<li>遴聘外部專家擔任客座諮詢顧問，提供全方位的國際行銷諮詢服務。</li>\n	<li>提供海外市場拓銷建議，節省資源與時間的耗費。</li>\n	<li>引導業者善用政府輔導資源，強化企業經營體質，提升國際競爭力。</li>\n</ul>\n\n<div class=\"goto_btn\"><a href=\"https://events.taiwantrade.com/exportadv\" target=\"_blank\">線上報名</a></div>\n</div>\n\n<div class=\"free_wrap\">\n<div class=\"clean free_title\">\n<div class=\"fr_ft\">03.諮詢服務的好處?</div>\n\n<div class=\"ft_ic\"><img alt=\"\" src=\"/images/down.svg\" /></div>\n</div>\n\n<ul>\n	<li>客製化、一站式、專業服務</li>\n	<li>精準拓銷建議、減少時間與金錢浪費</li>\n	<li>提供政府輔導資源</li>\n	<li>陪伴式輔導</li>\n</ul>\n</div>\n\n<div class=\"free_wrap\">\n<div class=\"clean free_title\">\n<div class=\"fr_ft\">04.誰來擔任諮詢服務?</div>\n\n<div class=\"ft_ic\"><img alt=\"\" src=\"/images/down.svg\" /></div>\n</div>\n\n<div class=\"free_qa_box\">\n<div class=\"fe_tittle\">國際行銷諮詢中心顧問群</div>\n</div>\n\n<div class=\"grp_box row\">\n<div class=\"col-6 col-lg-3 col-md-3\">\n<div class=\"free_group\">國際行銷諮詢中心<br />\n資深專業顧問</div>\n</div>\n\n<div class=\"col-6 col-lg-3 col-md-3\">\n<div class=\"free_group\">貿協曾外派<br />\n地區專家產業人員顧問群</div>\n</div>\n\n<div class=\"col-6 col-lg-3 col-md-3\">\n<div class=\"free_group\">外貿協會<br />\n全球駐外單位</div>\n</div>\n\n<div class=\"col-6 col-lg-3 col-md-3\">\n<div class=\"free_group\">外聘專業<br />\n客座諮詢顧問</div>\n</div>\n</div>\n\n<div class=\"grp_box people_box\">\n<table border=\"0\" style=\"width:100%\">\n	<tbody>\n		<tr>\n			<td>\n			<div class=\"people_pic\" style=\"background-image:url(/images/e2.png)\">&nbsp;</div>\n\n			<div class=\"people_name\">主任 侯文欽</div>\n\n			<div class=\"people_country\">美國、越南</div>\n			</td>\n			<td>\n			<div class=\"people_pic\" style=\"background-image:url(/images/e1.png)\">&nbsp;</div>\n\n			<div class=\"people_name\">副主任 張如蕙</div>\n\n			<div class=\"people_country\">加拿大</div>\n			</td>\n			<td>\n			<div class=\"people_pic\" style=\"background-image:url(/images/v7.png)\">&nbsp;</div>\n\n			<div class=\"people_name\">顧問 駱慧娟</div>\n\n			<div class=\"people_country\">日本</div>\n			</td>\n		</tr>\n		<tr>\n			<td>\n			<div class=\"people_pic\" style=\"background-image:url(/images/v1.png)\">&nbsp;</div>\n\n			<div class=\"people_name\">組長 吳雪鴻</div>\n\n			<div class=\"people_country\">西班牙</div>\n			</td>\n			<td>\n			<div class=\"people_pic\" style=\"background-image:url(/images/v2.png)\">&nbsp;</div>\n\n			<div class=\"people_name\">組長&nbsp;張瑞鴻</div>\n\n			<div class=\"people_country\">中國大陸</div>\n			</td>\n			<td>\n			<div class=\"people_pic\" style=\"background-image:url(/images/v4.png)\">&nbsp;</div>\n\n			<div class=\"people_name\">組長 蕭正宗</div>\n\n			<div class=\"people_country\">烏克蘭、俄羅斯</div>\n			</td>\n		</tr>\n		<tr>\n			<td>\n			<div class=\"people_pic\" style=\"background-image:url(/pic/images/pic/v8.png)\">&nbsp;</div>\n\n			<div class=\"people_name\">顧問 林憲章</div>\n\n			<div class=\"people_country\">\n			<div class=\"people_country\">南非、日本、中國大陸</div>\n			</div>\n			</td>\n			<td>\n			<div class=\"people_pic\" style=\"background-image:url(/pic/images/pic/v5.png)\">&nbsp;</div>\n\n			<div class=\"people_name\">顧問 楊冬松</div>\n\n			<div class=\"people_country\">孟加拉</div>\n			</td>\n			<td>\n			<div class=\"people_pic\" style=\"background-image:url(/images/v6.png)\">&nbsp;</div>\n\n			<div class=\"people_name\">顧問 杜富漢</div>\n\n			<div class=\"people_country\">杜拜、印度</div>\n			</td>\n		</tr>\n		<tr>\n			<td>\n			<div class=\"people_pic\" style=\"background-image:url(/images/v3.png)\">&nbsp;</div>\n\n			<div class=\"people_name\">專委 藍科銘</div>\n\n			<div class=\"people_country\">菲律賓</div>\n			</td>\n			<td>&nbsp;</td>\n			<td>&nbsp;</td>\n		</tr>\n	</tbody>\n</table>\n</div>\n\n<div class=\"free_full_pic2\"><img alt=\"\" src=\"/images/1558081476759.jpg\" /></div>\n</div>\n\n<div class=\"free_wrap\">\n<div class=\"clean free_title\">\n<div class=\"fr_ft\">05.諮詢服務內容?</div>\n\n<div class=\"ft_ic\"><img alt=\"\" src=\"/images/down.svg\" /></div>\n</div>\n\n<div class=\"free_full_pic\"><img alt=\"\" src=\"/images/etb.png\" /></div>\n\n<div class=\"free_full_pic row\">\n<div class=\"col-6 col-lg-6 col-md-6\">\n<div class=\"nbu_pic\"><img alt=\"\" src=\"/images/ve01.jpg\" /></div>\n</div>\n\n<div class=\"col-6 col-lg-6 col-md-6\">\n<div class=\"nbu_pic\"><img alt=\"\" src=\"/images/ve02.jpg\" /></div>\n</div>\n</div>\n\n<div class=\"goto_btn\"><a href=\"https://events.taiwantrade.com/exportadv\" target=\"_blank\">線上報名</a></div>\n</div>\n\n<div class=\"free_wrap\">\n<div class=\"clean free_title\">\n<div class=\"fr_ft\">06.諮詢流程?</div>\n\n<div class=\"ft_ic\"><img alt=\"\" src=\"/images/down.svg\" /></div>\n</div>\n\n<div class=\"free_full_pic\"><img alt=\"\" src=\"/images/step.jpg\" /></div>\n</div>\n\n<div class=\"free_wrap\">\n<div class=\"clean free_title\">\n<div class=\"fr_ft\">07.重要諮詢服務案例?</div>\n\n<div class=\"ft_ic\"><img alt=\"\" src=\"/images/down.svg\" /></div>\n</div>\n\n<div class=\"free_qa_box\">\n<div class=\"fe_tittle\">貿協國際行銷諮詢中心</div>\n\n<div class=\"fe_font\">專業顧問依據個別業者的拓銷需求，提供一對一、客製化的諮詢服務，包含協助分析目標市場、提供拓銷建議，並結合貿協63個全球據點， 協助業者篩選及媒合潛力買主與通路商；以及轉介適合業者運用的政府拓銷資源。 目前已協助業者成功佈建通路、取得海外訂單，以及獲得產品認證等具體成果：</div>\n</div>\n\n<div class=\"free_full_pic\"><img alt=\"\" src=\"/images/irkn.jpg\" /></div>\n\n<div class=\"free_ex\"><!-- <div class=\"exken_pin\"><a href=\"#\"><img src=\"/images/left.svg\" alt=\"\"></a></div> --><!-- <div class=\"exken_pin2\"><a href=\"#\"><img src=\"/images/right.svg\" alt=\"\"></a></div> -->\n<div class=\"free_ex_t_Bg\">案例1.</div>\n\n<div class=\"free_ex_content\">\n<div class=\"row\">\n<div class=\"col-12 col-lg-2 col-md-2\">\n<div class=\"user_pic\"><img alt=\"\" src=\"/images/user.svg\" /></div>\n</div>\n\n<div class=\"col-12 col-lg-10 col-md-10\">\n<div class=\"issu\">諮詢業者</div>\n\n<div class=\"issu_name\">生物可分解塑膠粒業者</div>\n\n<ul>\n	<li>拓銷需求\n	<p>開發歐洲市場、尋找買主</p>\n	</li>\n	<li>協助內容\n	<p>1.諮詢中心顧問運用「全球貿易大數據平台」協助業者篩選目標市場。<br />\n	2.貿協駐慕尼黑等歐洲地區辦事處協助媒洽當地潛在買主。</p>\n	</li>\n	<li>具體成效\n	<p>該公司開拓德國、法國及義大利市場，取得訂單。</p>\n	</li>\n</ul>\n</div>\n</div>\n</div>\n</div>\n\n<div class=\"goto_btn\"><a href=\"https://events.taiwantrade.com/exportadv\" target=\"_blank\">線上報名</a></div>\n</div>\n',	NULL,	'aa',	'bb',	'cc',	NULL,	'0000-00-00',	'2021-06-18 05:23:37'),
(2,	'各國關稅',	'快速找尋各國的關稅',	'',	'2021-02-22 04:31:46',	3,	1,	1,	1,	NULL,	NULL,	'',	'<div class=\"fe_tittle\"><a href=\"http://db2.wtocenter.org.tw/tariff\" target=\"_blank\">一、中華經濟研究院(WTO及RTA中心)網站關稅查詢系統 </a></div>\n            <div class=\"fe_font\">\n               WTO及RTA中心建製之「主要國家關稅查詢系統」，與WTO更新同步，該網站可依下列兩種方式查詢各國關稅:\n            </div>\n            <ul class=\"free_ul\">\n               <li>依稅號查詢: <a href=\"http://db2.wtocenter.org.tw/tariff/Search_byHSCode.aspx\" target=\"_blank\"> http://db2.wtocenter.org.tw/tariff/Search_byHSCode.aspx </a></li>\n               <li>輸入貨名查詢:<a href=\"http://db2.wtocenter.org.tw/tariff/search_byProducts.aspx\" target=\"_blank\">http://db2.wtocenter.org.tw/tariff/search_byProducts.aspx</a>  </li>\n            </ul>\n            <div class=\"fe_tittle\"><a href=\"https://itrade.taiwantrade.com/\" target=\"_blank\">二、iTrade (全球貿易大數據平台) </a></div>\n            <div class=\"fe_font\">\n               經濟部國際貿易局為協助業者拓銷海外市場，委託外貿協會建置之「itrade全球貿易大數據平台」，提供線上即時的出口情勢分析、跨國關稅比較、篩選潛力市場等大數據統計資訊服務，歡迎廠商多加運用。該網站綜整各國關稅網站，提供以下兩項查詢功能:\n            </div>\n            <ul class=\"free_ul\">\n               <li>單一出口國關稅查詢</li>\n               <li>多國關稅比較</li>\n            </ul>\n            <div class=\"fe_font\">\n               ※	如需了解外國進口關稅更多資訊，請參考本網站→<a href=\"https://exportadv.chun-mu.com/online_last2?id=9\" target=\"_blank\"> 「線上諮詢-外國進口關稅」。</a>\n            </div>',	NULL,	'',	'',	'',	NULL,	'0000-00-00',	'2021-02-21 20:31:46');
